INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 100101, 1, "2015/04/01 15:00:00", 1, "【物理】前衛で、敵前線を押し返す笑顔の元気娘。\n前衛に対して大ダメージを与えるユニオンバーストと、\n自身の攻撃力を強化するスキルを持つ攻撃役。", 100101, 450, 0, 1, "2030/12/31 15:00:00", 2.295, 100101, 200, 7, 0, "ヒヨリ", 0, 1, 100101, 0, "ひより");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 100201, 1, "2015/04/01 15:00:00", 7, "【魔法】最後衛から、味方の回復と補助を行う魔法士。\n打たれ弱いが高い魔法攻撃力を持ち、ランクを上げると\n攻撃も補助もバランスよくこなせるようになる。", 100201, 450, 0, 7, "2030/12/31 15:00:00", 2.27, 100201, 800, 7, 0, "ユイ", 0, 2, 100201, 0, "ゆい");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 100301, 1, "2015/04/01 15:00:00", 4, "【物理】前衛で、一点突破で敵を討つ、孤高の剣士。\nユニオンバースト、スキル共に眼前の敵を倒す事に優れ、\n攻撃スキルやカウンターを駆使して前線を押し上げる。", 100301, 450, 0, 4, "2030/12/31 15:00:00", 1.965, 100301, 250, 7, 0, "レイ", 0, 1, 100301, 0, "れい");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 100401, 1, "2015/04/01 15:00:00", 1, "【物理】最前衛で、敵の物理攻撃を邪魔するいたずら娘。\n目の前の敵を暗闇状態にし、命中率を大幅に下げるほか、\n敵一体の物理攻撃力を下げるスキルを持つ。", 100401, 450, 0, 1, "2030/12/31 15:00:00", 2.17, 100401, 205, 13, 0, "ミソギ", 0, 1, 100401, 0, "みそぎ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 100501, 2, "2018/09/18 15:00:00", 2, "【物理】前衛の、機敏な動きで敵をかき回す騎士見習い。\nユニオンバーストで相手の陣地の真ん中に飛び込み、\n自分の周囲を攻撃するスキルで相手を攻め立てる。", 100501, 450, 0, 2, "2030/12/31 15:00:00", 2.125, 100501, 185, 2, 0, "マツリ", 0, 1, 100501, 0, "まつり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 100601, 2, "2015/04/01 15:00:00", 6, "【魔法】中衛で、魔法パーティの強化を担う、双子の妹。\n敵の魔法防御力を大幅に下げるスキルや、魔法攻撃力を\n上昇させ、回復効果を付与するユニオンバーストを使う。", 100601, 450, 0, 6, "2030/12/31 15:00:00", 2.19, 100601, 570, 14, 0, "アカリ", 0, 2, 100601, 0, "あかり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 100701, 2, "2015/04/01 15:00:00", 3, "【物理】最前衛で、ひたすら敵の攻撃を避ける幽霊少女。\nスキルで幽霊に変身することで敵の攻撃を躱し、\nユニオンバーストでは敵をプリンにして食べてしまう。", 100701, 450, 0, 3, "2030/12/31 15:00:00", 1.7, 100701, 125, 14, 0, "ミヤコ", 0, 1, 100701, 0, "みやこ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 100801, 2, "2015/04/01 15:00:00", 7, "【魔法】後衛で物理パーティを補助する、歩く芸術作品。\n味方のユニオンバースト発動を早めるスキルのほか、\n暗闇状態にするスキルで敵の物理攻撃を封じる。", 100801, 450, 0, 21, "2030/12/31 15:00:00", 2.07, 100801, 805, 12, 0, "ユキ", 0, 2, 100801, 0, "ゆき");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 100901, 3, "2015/04/01 15:00:00", 5, "【魔法】中衛から圧倒的な魔力で攻撃する、疾風の冥姫。\nユニオンバーストで敵全体に大ダメージを与えるが、\n高すぎる魔力の為、自分自身にも相応のリスクが生じる。", 100901, 450, 0, 5, "2030/12/31 15:00:00", 2.25, 100901, 440, 11, 0, "アンナ", 0, 2, 100901, 0, "あんな");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 101001, 3, "2015/04/01 15:00:00", 7, "【魔法】後衛で味方のサポートを担当するメルヘン少女。\n味方全体を強化してＴＰを回復するユニオンバーストや、\nＨＰ回復、敵を暗闇にするスキルで戦況を好転させる。", 101001, 450, 0, 7, "2030/12/31 15:00:00", 2.27, 101001, 795, 4, 0, "マホ", 0, 2, 101001, 0, "まほ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 101101, 3, "2015/04/01 15:00:00", 8, "【物理】後衛から、矢の雨を降らせる妹系アーチャー。\nクリティカル率を高める重ね掛け可能なスキルを持ち、\nダメージ回数の多いユニオンバーストをより強力にする。", 101101, 450, 0, 8, "2030/12/31 15:00:00", 1.97, 101101, 700, 6, 0, "リノ", 0, 1, 101101, 0, "りの");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 101201, 3, "2015/04/01 15:00:00", 7, "【魔法】後衛の、対物理パーティが得意な超能力ガール。\nスキルが物理攻撃の敵に対して真価を発揮するため、\n物理攻撃型の敵パーティを一網打尽にする。", 101201, 450, 0, 7, "2030/12/31 15:00:00", 2.07, 101201, 755, 9, 0, "ハツネ", 0, 2, 101201, 0, "はつね");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 101301, 2, "2018/11/19 15:00:00", 7, "【魔法】後衛から多彩な魔法を放つ、オタク魔法少女。\n体力が一番多い相手を狙うユニオンバーストやスキルは、\n敵のＨＰ状況により攻撃対象が変わる高威力の魔法攻撃。", 101301, 450, 0, 7, "2030/12/31 15:00:00", 2.07, 101301, 740, 9, 0, "ナナカ", 0, 2, 101301, 0, "ななか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 101401, 3, "2019/02/28 12:00:00", 7, "【魔法】後衛で、相手の行動妨害に特化した名探偵。\n束縛や混乱を付与するスキルで相手の行動を妨害し、\n魔法防御力ダウンのフィールドを展開して王手をかける。", 101401, 450, 0, 21, "2030/12/31 15:00:00", 2.27, 101401, 730, 9, 0, "カスミ", 0, 2, 101401, 0, "かすみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 101501, 2, "2015/04/01 15:00:00", 7, "【魔法】後衛で魔法キャラを支援する、みんなの先生。\nユニオンバーストのＨＰ回復＆魔防アップ、先頭キャラの\n継続ＨＰ回復スキルは、味方の耐久力を大幅に高める。", 101501, 450, 0, 9, "2030/12/31 15:00:00", 2.27, 101501, 735, 9, 0, "ミサト", 0, 2, 101501, 0, "みさと");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 101601, 2, "2015/04/01 15:00:00", 8, "【物理】後衛からクリティカル攻撃するカリスマモデル。\nダメージ2倍のクリティカルダメージは\nスキルによる攻撃力アップでさらに破壊力を増す。", 101601, 450, 0, 8, "2030/12/31 15:00:00", 1.97, 101601, 705, 15, 0, "スズナ", 0, 1, 101601, 0, "すずな");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 101701, 2, "2015/04/01 15:00:00", 1, "【物理】最前衛で、累積スキルでダメージを稼ぐ南国娘。\nスキル「精神統一」を発動すると、カオリが攻撃する度に\n敵に効果が累積し、次のダメージがどんどん増えていく。", 101701, 450, 0, 1, "2030/12/31 15:00:00", 2.17, 101701, 145, 4, 0, "カオリ", 0, 1, 101701, 0, "かおり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 101801, 3, "2015/04/01 15:00:00", 5, "【魔法】後衛で、敵全体を誘惑するセクシー先生。\n敵のＴＰを奪うスキルでユニオンバースト発動を遅らせ、\n誘惑のユニオンバーストを放ち、戦場を大混乱に陥れる。", 101801, 450, 0, 5, "2030/12/31 15:00:00", 2.6, 101801, 715, 15, 0, "イオ", 0, 2, 101801, 0, "いお");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 102001, 2, "2015/04/01 15:00:00", 5, "【物理】中衛で、敵前衛を崩す、うさぎっこ。\nユニオンバーストは、最も近い敵に大ダメージを与えた後\n隣の敵にも攻撃するので、前衛を早期に攻め落とせる。", 102001, 450, 0, 5, "2030/12/31 15:00:00", 2.125, 102001, 360, 13, 0, "ミミ", 0, 1, 102001, 0, "みみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 102101, 1, "2015/04/01 15:00:00", 3, "【物理】前衛で、味方の守りに特化した、極度の照れ屋。\nスキルで自分の周囲の物理、魔法防御力を上げつつ、\n近くの敵をスタンさせて足止めする。", 102101, 450, 0, 3, "2030/12/31 15:00:00", 1.675, 102101, 240, 3, 0, "クルミ", 0, 1, 102101, 0, "くるみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 102201, 1, "2015/04/01 15:00:00", 6, "【魔法】中衛から、強力な魔法で攻め立てる、双子の姉。\n自身のＨＰと引き換えに魔法攻撃力を増幅し、\nユニオンバーストやスキルの威力を高めて攻撃する。", 102201, 450, 0, 6, "2030/12/31 15:00:00", 2.19, 102201, 575, 14, 0, "ヨリ", 0, 2, 102201, 0, "より");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 102301, 2, "2015/04/01 15:00:00", 3, "【物理】前衛で、戦場をかき乱す、くまっ子。\nユニオンバーストで、相手を思い切り吹き飛ばすと同時に\nスタンと大ダメージを与えることで敵陣形を大きく乱す。", 102301, 450, 0, 3, "2030/12/31 15:00:00", 1.425, 102301, 210, 3, 0, "アヤネ", 0, 1, 102301, 0, "あやね");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 102501, 1, "2015/04/01 15:00:00", 7, "【魔法】後衛で、回復と攻撃をこなすドジっ娘メイド。\n周りの味方のＨＰを回復しつつ物理攻撃力を高める\nスキルは、中衛・後衛の攻撃役と抜群の相性。", 102501, 450, 0, 7, "2030/12/31 15:00:00", 2.27, 102501, 720, 3, 0, "スズメ", 0, 2, 102501, 0, "すずめ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 102601, 2, "2015/04/01 15:00:00", 6, "【物理】中衛で物理パーティを強化するものぐさ少女。\n味方の物理攻撃力をアップしつつ、味方の魔法防御を\n高めることで攻守ともにパーティをサポートする。", 102601, 450, 0, 6, "2030/12/31 15:00:00", 2.34, 102601, 550, 3, 0, "リン", 0, 1, 102601, 0, "りん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 102701, 2, "2015/04/01 15:00:00", 3, "【物理】前衛で、毒スキルで敵を粉砕する、通称壊し屋。\n最高クラスの攻撃力を持ち、ユニオンバーストで敵に\nとどめの一撃を放つ毎に、その攻撃力はさらに上昇する。", 102701, 450, 0, 3, "2030/12/31 15:00:00", 1.425, 102701, 230, 11, 0, "エリコ", 0, 1, 102701, 0, "えりこ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 102801, 3, "2015/04/01 15:00:00", 4, "【物理】中衛で一発逆転を狙う、みんなのサレンママ。\nＨＰが下がるほどダメージが上昇するユニオンバーストと\n味方のＴＰを回復するスキルで、一気に形勢を逆転する。", 102801, 450, 0, 4, "2030/12/31 15:00:00", 2.09, 102801, 430, 3, 0, "サレン", 0, 1, 102801, 0, "されん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 102901, 3, "2015/04/01 15:00:00", 4, "【物理】前衛で、皆の壁になって戦うアイドルのぞみん。\n彼女がステージに立てば、味方の物理攻撃力が\n大きくアップし、さらに敵の注意を一手に惹き付ける。", 102901, 450, 0, 4, "2030/12/31 15:00:00", 1.965, 102901, 160, 10, 0, "ノゾミ", 0, 1, 102901, 0, "のぞみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 103001, 3, "2015/04/01 15:00:00", 5, "【物理】中衛で、強力な範囲攻撃を操る、忍術の使い手。\n範囲攻撃のスキルで敵を倒す事で、自分のＴＰを回復し、\n強力なユニオンバーストの発動頻度を上げる。", 103001, 450, 0, 5, "2030/12/31 15:00:00", 2.25, 103001, 415, 12, 0, "ニノン", 0, 1, 103001, 0, "にのん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 103101, 2, "2015/04/01 15:00:00", 5, "【物理】中衛で、父親のドクロを召喚して戦う霊能少女。\n召喚した父親は、自分とは別に攻撃を行ってくれるほか、\nダメージを代わりに受けてくれることもある。", 103101, 450, 0, 5, "2030/12/31 15:00:00", 2.25, 103101, 365, 14, 0, "シノブ", 0, 1, 103101, 0, "しのぶ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 103201, 3, "2015/04/01 15:00:00", 5, "【物理】前衛で大暴れして攻める、令嬢剣士。\n自分の周りに、味方を回復するフィールドを作り出し、\n自ら前線を支え導く姿も、名家を背負う者のあるべき姿。", 103201, 450, 0, 5, "2030/12/31 15:00:00", 2.125, 103201, 180, 8, 0, "アキノ", 0, 1, 103201, 0, "あきの");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 103301, 2, "2015/04/01 15:00:00", 6, "【物理】中衛で、相手の動きを乱す牧場主。\n敵前衛をノックバックさせることで、隊列を崩し、\n他のキャラが使う範囲攻撃の対象に敵を押し込む。", 103301, 450, 0, 6, "2030/12/31 15:00:00", 2.34, 103301, 395, 5, 0, "マヒル", 0, 1, 103301, 0, "まひる");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 103401, 1, "2015/04/01 15:00:00", 5, "【物理】中衛から、バリアや回復で味方を守る元聖騎士。\n傷ついた味方のＨＰやＴＰを回復するスキルを操り、\n打ち合いで消耗した所を、ピンポイントでサポートする。", 103401, 450, 0, 5, "2030/12/31 15:00:00", 2.4, 103401, 405, 8, 0, "ユカリ", 0, 1, 103401, 0, "ゆかり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 103601, 3, "2015/04/01 15:00:00", 7, "【魔法】後衛から強力な魔法で攻撃するちびっこ優等生。\nスキルで魔法攻撃力を瞬間的に高めた後に放つ\nユニオンバーストは敵単体への威力抜群。", 103601, 450, 0, 7, "2030/12/31 15:00:00", 2.07, 103601, 810, 0, 0, "キョウカ", 0, 2, 103601, 0, "きょうか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 103701, 3, "2015/04/01 15:00:00", 4, "【物理】前衛で、素早い斬撃を仕掛け敵を屠る剣術少女。\nユニオンバーストで自分の攻撃力と行動速度を上昇させ、\nほか攻撃スキルの殲滅能力を極限まで高め敵を圧倒する。", 103701, 450, 0, 4, "2030/12/31 15:00:00", 1.965, 103701, 220, 2, 0, "トモ", 0, 1, 103701, 0, "とも");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 103801, 2, "2015/04/01 15:00:00", 8, "【物理】最後衛から高火力スキルを連発するスナイパー。\nダメージを与えつつ、ＴＰを回復するスキルを持ち、\n強力な一撃のユニオンバーストを、素早く発動する。", 103801, 450, 0, 8, "2030/12/31 15:00:00", 1.97, 103801, 710, 5, 0, "シオリ", 0, 1, 103801, 0, "しおり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 104001, 1, "2015/04/01 15:00:00", 8, "【物理】最後衛から状態異常の矢を放つ、ぼっちの射手。\nダメージと共に付与する毒や麻痺の追加効果により、\n防御力の高い敵であっても、確実にＨＰを削りとる。", 104001, 450, 0, 8, "2030/12/31 15:00:00", 1.97, 104001, 785, 9, 0, "アオイ", 0, 1, 104001, 0, "あおい");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 104201, 2, "2015/04/01 15:00:00", 7, "【魔法】後衛から、前衛の戦いをサポートする唱喚士。\nユニオンバーストで、味方の回復と敵への攻撃を行う\n精霊を最前線に唱喚する。", 104201, 450, 0, 7, "2030/12/31 15:00:00", 2.27, 104201, 790, 10, 0, "チカ", 0, 2, 104201, 0, "ちか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 104301, 3, "2015/04/01 15:00:00", 5, "【物理】前衛で、敵の防御力を削り取る、正義の獣人。\n敵の盾役の防御力を下げ、着実にダメージを与えることで\n早期に敵の守りを突破する。", 104301, 450, 0, 5, "2030/12/31 15:00:00", 2.125, 104301, 165, 4, 0, "マコト", 0, 1, 104301, 0, "まこと");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 104401, 3, "2015/04/01 15:00:00", 3, "【魔法】中衛で命を削り攻撃する「夜を統べる者」。\n自身のＨＰと引き換えに放つスキルは高い殲滅力を誇り\n範囲攻撃における威力では他の追随を許さない。", 104401, 450, 0, 3, "2030/12/31 15:00:00", 1.425, 104401, 425, 12, 0, "イリヤ", 0, 2, 104401, 0, "いりや");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 104501, 2, "2015/04/01 15:00:00", 2, "【物理】前衛で囮となり、攻撃を引き付ける暴走ドＭ娘。\nユニオンバーストにより、自身に魔法バリアを張り、\n敵の魔法攻撃を吸収してＨＰを回復する。", 104501, 450, 0, 2, "2030/12/31 15:00:00", 2.375, 104501, 130, 12, 0, "クウカ", 0, 1, 104501, 0, "くうか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 104601, 2, "2015/04/01 15:00:00", 2, "【物理】前衛の、対魔法パーティが得意な気まぐれ猫娘。\n攻撃スキルは、「魔法攻撃力が一番高い敵」を狙い撃ち、\nダメージ、魔法攻撃力ダウン、ＴＰ吸収と畳み掛ける。", 104601, 450, 0, 2, "2030/12/31 15:00:00", 2.25, 104601, 215, 8, 0, "タマキ", 0, 1, 104601, 0, "たまき");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 104701, 3, "2015/04/01 15:00:00", 5, "【物理】最前衛で、完全防御スキルを操る騎士団長。\nユニオンバーストであらゆるダメージを吸収するバリアを\n展開できる。特に長期戦で圧倒的な防御性能を誇る。", 104701, 450, 0, 5, "2030/12/31 15:00:00", 2.125, 104701, 135, 2, 0, "ジュン", 0, 1, 104701, 0, "じゅん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 104801, 2, "2015/04/01 15:00:00", 6, "【物理】中衛の、スタンと回復のスキルを持つ傭兵戦士。\n高い防御力と自己回復能力を併せ持つ事で、\n中衛の守りを堅固にし、パーティを底支えする。", 104801, 450, 0, 6, "2030/12/31 15:00:00", 2.19, 104801, 420, 8, 0, "ミフユ", 0, 1, 104801, 0, "みふゆ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 104901, 3, "2015/04/01 15:00:00", 5, "【物理】前衛で、物理攻撃から味方を守る、お姉ちゃん。\nスキルで物理無効バリアを展開し、味方全員を守るほか、\n自身はさらに物理吸収バリアを纏い、敵前衛を討つ。", 104901, 450, 0, 5, "2030/12/31 15:00:00", 2.375, 104901, 285, 6, 0, "シズル", 0, 1, 104901, 0, "しずる");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 105001, 1, "2015/04/01 15:00:00", 7, "【魔法】後衛から、範囲攻撃を行う、レディ・ウィッチ。\n複数回の範囲攻撃を放つスキルや、目の前の敵全てを\n攻撃するユニオンバーストを持ち、範囲殲滅に特化する。", 105001, 450, 0, 7, "2030/12/31 15:00:00", 2.07, 105001, 760, 15, 0, "ミサキ", 0, 2, 105001, 0, "みさき");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 105101, 2, "2015/04/01 15:00:00", 5, "【物理】中衛で、敵弱体化フィールドを操る隻眼の悪魔。\nフィールドの持続時間は短いが、範囲内の敵の\n物理防御力を大幅に減らす効果を持つ。", 105101, 450, 0, 5, "2030/12/31 15:00:00", 2.25, 105101, 565, 11, 0, "ミツキ", 0, 1, 105101, 0, "みつき");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 105201, 1, "2015/04/01 15:00:00", 4, "【物理】最前衛で味方を守る、恋する乙女。\nバトル開始後、しばらくしてから最前線まで\n突進してきて、敵の目の前に立ちはだかる。", 105201, 450, 0, 4, "2030/12/31 15:00:00", 2.215, 105201, 105, 5, 0, "リマ", 0, 1, 105201, 0, "りま");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 105301, 3, "2015/04/01 15:00:00", 4, "【物理】中衛で、味方の攻撃を鼓舞する、軍人娘。\n味方全体の物理、魔法攻撃力の大幅アップに加えて、\n攻撃速度もあげることで、戦闘の早期終結を実現する。", 105301, 450, 0, 4, "2030/12/31 15:00:00", 2.24, 105301, 410, 12, 0, "モニカ", 0, 1, 105301, 0, "もにか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 105401, 2, "2015/04/01 15:00:00", 1, "【物理】前衛で、敵の妨害に特化したテーラーガール。\n敵を強制的に移動させる事で陣形を崩し、さらに\n移動速度・行動速度を低下させ相手の反撃を遅らせる。", 105401, 450, 0, 1, "2030/12/31 15:00:00", 2.42, 105401, 195, 10, 0, "ツムギ", 0, 1, 105401, 0, "つむぎ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 105501, 1, "2019/03/19 15:00:00", 48, "【物理】中衛で、どたばたと敵をかく乱する、純情少女。\n敵をスタンさせるスキルのほか、ユニオンバーストでは\n暗闇と混乱を付与することで敵を邪魔することができる。", 105501, 450, 0, 48, "2030/12/31 15:00:00", 2.34, 105501, 510, 12, 0, "アユミ", 0, 1, 105501, 0, "あゆみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 105601, 3, "2018/11/03 19:00:00", 4, "【物理】前衛で味方のため剣を振るう、いなせな姉御。\n相手へのカウンターも行う挑発や、敵の防御力を下げる\nユニオンバーストを持ち、攻防両面で実力を発揮する。", 105601, 450, 0, 4, "2030/12/31 15:00:00", 1.965, 105601, 158, 2, 0, "ルカ", 0, 1, 105601, 0, "るか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 105701, 3, "2015/04/01 15:00:00", 4, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", 170101, 450, 0, 4, "2030/12/31 15:00:00", 1.965, 105701, 245, 4, 0, "ジータ", 0, 1, 105701, 0, "じーた");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 105801, 1, "2015/04/01 15:00:00", 5, "【物理】前衛にて、全力で仲間を護る、腹ペコ剣士。\n高いＨＰに加えて、自分自身でもＨＰ回復できるため\nギリギリまで味方の壁役を引き受ける。", 105801, 450, 0, 5, "2030/12/31 15:00:00", 2.25, 105801, 155, 1, 0, "ペコリーヌ", 0, 1, 105801, 0, "ぺこりーぬ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 105901, 1, "2015/04/01 15:00:00", 6, "【物理】中衛で、補助と攻撃で皆を支える、導きの巫女。\nユニオンバーストは、味方全体の攻撃力アップに加えて\n自らも回復するため、継続的なサポートが可能となる。", 105901, 450, 0, 6, "2030/12/31 15:00:00", 2.34, 105901, 500, 1, 0, "コッコロ", 0, 1, 105901, 0, "こっころ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 106001, 1, "2015/04/01 15:00:00", 7, "【魔法】後衛から、強力な全体攻撃を放つ、強気な猫娘。\nスキルで敵の物理、魔法両方の防御力を下げるため\n編成を選ばずにバトルを有利に進められる。", 106001, 450, 0, 7, "2030/12/31 15:00:00", 2.07, 106001, 750, 1, 0, "キャル", 0, 2, 106001, 0, "きゃる");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 106101, 3, "2024/06/30 12:00:00", 2, "【物理】前衛で、伝説の剣「天楼覇断剣」を振るう少女。\n小技を駆使する通常の戦闘スタイルから一転、ユニオン\nバースト後は「天楼覇断剣」を携え、敵を薙ぎ払う。", 106101, 450, 0, 2, "2024/07/03 18:59:59", 1.8, 106101, 162, 7, 0, "ムイミ", 0, 1, 106101, 1, "むいみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 106301, 3, "2015/04/01 15:00:00", 8, "【物理】後衛の、長期戦に優れた、森の守護者見習い。\nＴＰ回復によるユニオンバーストの速攻が可能。さらに\n使用後はスキル効果が上昇するため高い殲滅力を誇る。", 106301, 450, 0, 8, "2030/12/31 15:00:00", 1.97, 106301, 625, 1, 0, "アリサ", 0, 1, 106301, 0, "ありさ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 106401, 3, "2021/02/15 23:00:00", 4, "【物理】中衛で氷雪を操り敵を凍滅する、氷竜の少女。\nユニオンバーストで獲得する【氷竜の印】を消費して、\nスキルの効果を増幅し、清廉な剣技で敵を切り伏せる。", 106401, 450, 0, 4, "2030/12/31 15:00:00", 1.84, 106401, 368, 1, 0, "シェフィ", 0, 1, 106401, 0, "しぇふぃ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 106501, 3, "2019/11/15 15:00:00", 1, "【物理】前衛で、敵を殴り倒す喧嘩屋ドラゴン族。\nスキルで自身の物理攻撃力を高め、全身全霊を懸け放つ\n初弾のユニオンバーストは、超大な破壊力を誇る。", 106501, 450, 0, 1, "2030/12/31 15:00:00", 2.17, 106501, 168, 17, 0, "カヤ", 0, 1, 106501, 0, "かや");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 106601, 3, "2020/06/17 15:00:00", 3, "【物理】前衛で範囲攻撃が得意な口達者のドラゴン娘。\nユニオンバーストで範囲内の敵をまとめて吹き飛ばし、\n陣形を乱したところで、敵を一気に焼き尽くす。", 106601, 450, 0, 3, "2030/12/31 15:00:00", 1.55, 106601, 197, 17, 0, "イノリ", 0, 1, 106601, 0, "いのり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 106701, 3, "2024/06/30 12:00:00", 7, "【魔法】後衛から無窮の魔力で全てを支配する龍の首領。\n障壁となる敵を龍眼で捉え、多彩な補助系スキルで敵の\n魔法攻撃からの耐性を弱め、雷霆の一撃で灰燼に帰す。", 106701, 450, 0, 21, "2024/07/03 18:59:59", 2.27, 106701, 727, 17, 0, "ホマレ", 0, 2, 106701, 1, "ほまれ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 106801, 3, "2024/06/30 12:00:00", 4, "【物理】中衛で、万有を自在に創造する『迷宮女王』。\n七冠としての権能を解放するユニオンバーストで自身を\n極大に強化し比類ない攻撃能力で仇なす者を剿滅する。", 106801, 450, 0, 4, "2024/07/03 18:59:59", 1.55, 106801, 560, 6, 0, "ラビリスタ", 0, 1, 106801, 1, "らびりすた");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 106901, 3, "2022/11/15 15:00:00", 45, "【物理】後衛で、天の星を瞳に宿し、覇道を進む皇。\n権能を解放し敵全体のバリアと全ステータスアップ効果を\n解除し、耐久力ダウンと複数の広範囲攻撃で敵を滅する。", 106901, 450, 0, 0, "2030/12/31 15:00:00", 2.0, 106901, 660, 1, 0, "カイザーインサイト", 0, 1, 106901, 1, "かいざーいんさいと");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 107001, 3, "2024/06/30 12:00:00", 0, "【魔法】後衛で、分身生成し敵を圧倒する『変貌大妃』。\n分身はネネカ自身と同じスキルをくり出し敵を攻撃する。\nその攻撃密度と制圧力の高さは他の追随を許さない。", 107001, 450, 0, 0, "2024/07/03 18:59:59", 2.0, 107001, 660, 1, 0, "ネネカ", 0, 2, 107001, 1, "ねねか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 107101, 3, "2024/06/30 12:00:00", 4, "【物理】前衛で、絶対的な制圧力を誇る『誓約女君』。\n攻防一体かつ超大な破壊力を誇るユニオンバーストと、\nその発動を加速するＴＰ上昇アップスキルを併せ持つ。", 107101, 450, 0, 10, "2024/07/03 18:59:59", 2.0, 107101, 290, 2, 0, "クリスティーナ", 0, 1, 107101, 1, "くりすてぃーな");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 107501, 3, "2024/06/21 12:00:00", 5, "【物理】前衛から強烈な範囲攻撃を放つ、渚のお姫様。\nかき氷を食べて物理攻撃力を一気に上昇させ、\nユニオンバーストを放つことで前方の敵を殲滅する。", 107501, 450, 0, 5, "2024/06/26 11:59:59", 2.125, 107501, 235, 1, 0, "ペコリーヌ（サマー）", 0, 1, 107501, 1, "ぺこりーぬ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 107601, 1, "2020/06/19 15:00:00", 6, "【物理】中衛で、物理キャラの補助を行う癒しの巫女。\nＨＰが一番少ない味方単体への特大回復スキルを持ち、\n瀕死の味方ですら瞬時に治癒する。", 107601, 450, 0, 6, "2030/12/31 15:00:00", 2.34, 107601, 535, 1, 0, "コッコロ（サマー）", 0, 1, 107601, 1, "こっころ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 107701, 3, "2024/06/21 12:00:00", 7, "【魔法】後衛の防衛能力に秀でた、夏のドジっ娘メイド。\n味方全体に防御力アップと継続ＨＰ回復をかけ、\nさらに壁になるゴーレムを呼んで、戦線を支える。", 107701, 450, 0, 7, "2024/06/26 11:59:59", 2.07, 107701, 775, 3, 0, "スズメ（サマー）", 0, 2, 107701, 1, "すずめ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 107801, 3, "2024/06/21 12:00:00", 7, "【魔法】後衛から強力な単体攻撃を放つ真夏の猫娘。\nスキルで敵の魔法防御力を下げた上で、\n敵単体への魔法攻撃を繰り出し、大ダメージを与える。", 107801, 450, 0, 7, "2024/06/26 11:59:59", 1.92, 107801, 780, 1, 0, "キャル（サマー）", 0, 2, 107801, 1, "きゃる");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 107901, 3, "2024/06/21 12:00:00", 2, "【物理】前衛で連続攻撃を放つ、海辺の気まぐれ猫娘。\nランダムな相手への単体攻撃を計４度行う\nユニオンバーストは、対象がランダムだが威力は抜群。", 107901, 450, 0, 2, "2024/06/26 11:59:59", 2.0, 107901, 225, 8, 0, "タマキ（サマー）", 0, 1, 107901, 1, "たまき");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 108001, 1, "2020/07/20 15:00:00", 6, "【物理】中衛で、攻撃と補助の両方をこなす海の傭兵。\nユニオンバーストの効果で味方全体の物理攻撃力を高め、\n物理攻撃パーティの能力アップに一役買う。", 108001, 450, 0, 6, "2030/12/31 15:00:00", 2.19, 108001, 495, 8, 0, "ミフユ（サマー）", 0, 1, 108001, 1, "みふゆ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 108101, 3, "2023/10/23 12:00:00", 3, "【物理】中衛で、弱った敵を刈り取る幻夜の霊能少女。\n弱った敵単体に大ダメージを与えるユニオンバーストは\n対象を撃破時さらに敵全体に追加ダメージを与える。", 108101, 450, 0, 3, "2023/10/26 11:59:59", 1.55, 108101, 440, 0, 0, "シノブ（ハロウィン）", 0, 1, 108101, 1, "しのぶ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 108201, 1, "2020/09/23 15:00:00", 1, "【物理】中衛から、敵陣の後方を狙い撃つ幽霊狼少女。\n前方の相手を無視して妨害スキルやユニオンバーストを\n敵後方に放ち、特に防御力が低いキャラの脅威になる。", 108201, 450, 0, 1, "2030/12/31 15:00:00", 2.42, 108201, 590, 0, 0, "ミヤコ（ハロウィン）", 0, 1, 108201, 1, "みやこ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 108301, 3, "2023/10/23 12:00:00", 7, "【魔法】後衛で、妨害スキルを操るオシャレ魔法少女。\n相手を誘惑状態にするスキルや、複数の状態異常を\n同時に付与するユニオンバーストで相手をかく乱する。", 108301, 450, 0, 7, "2023/10/26 11:59:59", 2.07, 108301, 815, 15, 0, "ミサキ（ハロウィン）", 0, 2, 108301, 1, "みさき");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 108401, 3, "2023/12/22 12:00:00", 7, "【魔法】後衛で、精霊を唱喚して戦う雪華の歌姫。\nユニオンバーストで呼び出す精霊たちはＨＰやＴＰを\n回復する能力を持ち、不利な戦況をも一変させる。", 108401, 450, 0, 7, "2023/12/27 11:59:59", 2.27, 108401, 770, 10, 0, "チカ（クリスマス）", 0, 2, 108401, 1, "ちか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 108501, 1, "2020/11/24 15:00:00", 3, "【物理】前衛から、ベルの音色で味方を守る小さな女優。\n攻撃を受けるまで周囲にいる味方の防御力を大きく高める\nスキルを持つ。活用できれば無類の耐久力を誇る。", 108501, 450, 0, 3, "2030/12/31 15:00:00", 1.55, 108501, 295, 15, 0, "クルミ（クリスマス）", 0, 1, 108501, 1, "くるみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 108601, 3, "2023/12/22 12:00:00", 3, "【物理】前衛で、敵をなぎ倒していく聖夜のくまっ子。\nユニオンバーストはＨＰを消費するが威力は絶大。\nスキルで物理攻撃力を上げ、さらにダメージアップ。", 108601, 450, 0, 3, "2023/12/27 11:59:59", 1.425, 108601, 190, 10, 0, "アヤネ（クリスマス）", 0, 1, 108601, 1, "あやね");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 108701, 3, "2024/03/11 12:00:00", 1, "【物理】前衛で、物理火力を担う、振り袖姿の元気娘。\n物理攻撃キャラの攻撃力を上昇させるスキルを使う。\nさらに高い威力の単体ユニオンバーストの攻撃力は随一。", 108701, 450, 0, 1, "2024/03/18 11:59:59", 2.17, 108701, 170, 7, 0, "ヒヨリ（ニューイヤー）", 0, 1, 108701, 1, "ひより");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 108801, 3, "2024/03/11 12:00:00", 7, "【魔法】後衛の、補助魔法に特化した、晴れ姿の癒し手。\n自身の攻撃力と引き換えに強力なバリアと継続回復状態を\n味方全体に付与する。絶大な防御能力は他を圧倒する。", 108801, 450, 0, 21, "2024/03/18 11:59:59", 2.27, 108801, 745, 7, 0, "ユイ（ニューイヤー）", 0, 2, 108801, 1, "ゆい");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 108901, 1, "2020/12/22 15:00:00", 4, "【物理】前衛で、魔法攻撃から味方を守る、華麗な剣士。\nスキルで範囲内の味方に魔法無効バリアを展開し、\nさらにユニオンバーストで敵をスタンさせ攻撃を断つ。", 108901, 450, 0, 22, "2030/12/31 15:00:00", 2.215, 108901, 153, 7, 0, "レイ（ニューイヤー）", 0, 1, 108901, 1, "れい");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 109001, 1, "2021/01/25 15:00:00", 3, "【物理】前衛で、ピンチをチャンスに変える愛の壊し屋。\nスキルはＨＰを消費し、自身の攻撃力を高める。また、\nユニオンバーストはＨＰが低いほど超絶威力を発揮する。", 109001, 450, 0, 3, "2030/12/31 15:00:00", 1.9, 109001, 187, 11, 0, "エリコ（バレンタイン）", 0, 1, 109001, 1, "えりこ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 109101, 3, "2024/01/22 12:00:00", 5, "【物理】中衛で皆を助けるパティシエールのお姉ちゃん。\n複数のパラメータが同時に上昇するフィールドを展開し、\nさらに効果時間中はスキル効果が大幅に強化される。", 109101, 450, 0, 5, "2024/01/26 11:59:59", 2.125, 109101, 385, 7, 0, "シズル（バレンタイン）", 0, 1, 109101, 1, "しずる");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 109201, 3, "2019/03/31 12:00:00", 7, "【魔法】後衛で、英霊の召喚術を武器に戦うお姫様。\n味方に英霊の加護を付与するスキルによるサポーターと、\n高威力の魔法によるアタッカーの二つの役割を併せ持つ。", 109201, 450, 0, 23, "2030/12/31 15:00:00", 2.27, 109201, 630, 6, 0, "アン", 0, 2, 109201, 0, "あん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 109301, 1, "2021/03/23 15:00:00", 7, "【魔法】後衛で、オメメちゃんと戦う、ノーテンキ少女。\nスキルで呼び出すオメメちゃんは敵の攻撃を防ぐほか、\nその数が多いほどユニオンバーストの威力を増加させる。", 109301, 450, 0, 23, "2030/12/31 15:00:00", 2.27, 109301, 640, 9, 0, "ルゥ", 0, 2, 109301, 1, "るぅ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 109401, 3, "2019/04/19 15:00:00", 1, "【魔法】中衛で、炎を操り敵を薙ぎ払う、竜人の少女。\n高い魔法攻撃力を生かした範囲攻撃を得意とする。\nまた、飛行能力を駆使して放つ突進攻撃も強力。", 109401, 450, 0, 1, "2030/12/31 15:00:00", 2.27, 109401, 525, 9, 0, "グレア", 0, 2, 109401, 0, "ぐれあ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 109501, 3, "2019/04/30 12:00:00", 7, "【魔法】最前衛で、味方を鼓舞する着物姿のドＭ娘。\n味方の魔法攻撃力を高め、敵の魔法防御力を下げる事で、\n魔法パーティのサポート兼防御役として活躍する。", 109501, 450, 0, 2, "2030/12/31 15:00:00", 2.066, 109501, 140, 12, 0, "クウカ（オーエド）", 0, 2, 109501, 0, "くうか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 109601, 3, "2019/05/17 15:00:00", 2, "【物理】最前衛で、忍法を駆使して敵と戦うクノイチ。\nユニオンバーストはクリティカル時のダメージを１．５倍\nにする特性を持ち、うまくかみ合った時の威力は抜群。", 109601, 450, 0, 2, "2030/12/31 15:00:00", 2.0, 109601, 175, 12, 0, "ニノン（オーエド）", 0, 1, 109601, 0, "にのん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 109701, 3, "2020/11/10 12:00:00", 13, "【物理】中衛で、鬼の力で敵を粉砕する、双子の妹。\n回復スキルの他にも、温度を操るスキルを得意とし、\n敵を凍結させた上でユニオンバーストで薙ぎ払う。", 109701, 450, 0, 24, "2020/11/21 14:59:59", 2.25, 109701, 540, 9, 0, "レム", 0, 1, 109701, 1, "れむ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 109801, 1, "2015/04/01 15:00:00", 7, "【魔法】中衛で、特殊能力で味方を補助する、双子の姉。\n相手の物理攻撃を見切って回避させる「千里眼」や、\n敵全体を束縛するユニオンバーストの補助は効果絶大。", 109801, 450, 0, 24, "2030/12/31 15:00:00", 2.5, 109801, 545, 9, 0, "ラム", 0, 2, 109801, 1, "らむ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 109901, 3, "2020/11/10 12:00:00", 7, "【魔法】後衛で、攻撃と回復をこなす、ハーフエルフ。\n高い魔力で攻撃魔法を繰り出して敵を蹴散らしつつ、\nユニオンバーストは瀕死の味方すらも瞬時に癒す。", 109901, 450, 0, 23, "2020/11/21 14:59:59", 2.27, 109901, 725, 9, 0, "エミリア", 0, 2, 109901, 1, "えみりあ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 110001, 3, "2024/06/21 12:00:00", 8, "【物理】後衛で高威力の弓技を放つ夏のカリスマモデル。\nバトル中に放つ「サマーランウェイ♪」でＴＰを全回復\nして、発動後のユニオンバーストがクリティカルになる。", 110001, 450, 0, 8, "2024/06/26 11:59:59", 1.82, 110001, 705, 15, 0, "スズナ（サマー）", 0, 1, 110001, 1, "すずな");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 110101, 1, "2021/05/18 15:00:00", 5, "【魔法】後衛で、敵の体力を奪い取る、夏の夜の先生。\nダメージを与えつつ味方を回復するスキルを複数持ち、\n攻守どちらの側でも高い能力を発揮する。", 110101, 450, 0, 5, "2030/12/31 15:00:00", 2.4, 110101, 715, 15, 0, "イオ（サマー）", 0, 2, 110101, 1, "いお");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 0, 1, "2015/04/01 15:00:00", 7, "", 0, 0, 0, 7, "2030/12/31 15:00:00", 0.0, 110201, 0, 15, 0, "ミサキ（サマー）", 0, 0, 110201, 0, "みさき");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 110301, 3, "2024/06/21 12:00:00", 4, "【物理】中衛で、味方の速攻を支える海辺のサレンママ。\nバトル開始時に味方全体のＴＰを一気に溜めることで、\n迅速にユニオンバーストを発動させることを可能にする。", 110301, 450, 0, 4, "2024/06/26 11:59:59", 2.24, 110301, 585, 3, 0, "サレン（サマー）", 0, 1, 110301, 1, "されん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 110401, 3, "2024/07/23 12:00:00", 5, "【物理】前衛で攻撃対象が１つの敵に特化した海の狼娘。\n攻撃対象が１つの場合、スキルとユニオンバーストともに\n真価を発揮し他を圧倒する絶大な破壊力で敵をなぎ払う。", 110401, 450, 0, 5, "2024/07/31 11:59:59", 2.125, 110401, 180, 4, 0, "マコト（サマー）", 0, 1, 110401, 1, "まこと");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 110501, 1, "2021/06/18 15:00:00", 1, "【物理】中衛で、敵をまとめてなぎ倒す、真夏の南国娘。\n吹き飛ばし効果を持つスキルで敵をまとめ、攻撃対象が\n多い程、威力が増すユニオンバーストで敵をなぎ倒す。", 110501, 450, 0, 1, "2030/12/31 15:00:00", 2.42, 110501, 425, 4, 0, "カオリ（サマー）", 0, 1, 110501, 1, "かおり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 110601, 3, "2024/07/23 12:00:00", 7, "【魔法】後衛で、膨大な魔力を振るう、真夏のおとぎ姫。\n高火力で対象がランダムなスキルやユニオンバーストは、\n攻撃対象が１つの敵に対して絶大なダメージを叩き出す。", 110601, 450, 0, 7, "2024/07/31 11:59:59", 2.27, 110601, 792, 4, 0, "マホ（サマー）", 0, 2, 110601, 1, "まほ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 110701, 3, "2019/09/03 21:00:00", 8, "【物理】後衛で毒を操る、ぼっちエルフの編入生。\n敵が毒や猛毒になっていると強化される攻撃スキルと、\n敵の物理防御力を下げるスキルで味方をサポートする。", 110701, 450, 0, 8, "2030/12/31 15:00:00", 1.82, 110701, 680, 4, 0, "アオイ（編入生）", 0, 1, 110701, 0, "あおい");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 110801, 3, "2019/09/16 15:00:00", 2, "【物理】前衛で、手数で圧倒する、ダウナー系エルフ。\n攻撃するたびに相手に【畏縮】ステータスを追加し、\nスキルのダメージと物理防御力ダウンに磨きをかける。", 110801, 450, 0, 2, "2030/12/31 15:00:00", 2.125, 110801, 185, 2, 0, "クロエ", 0, 1, 110801, 0, "くろえ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 110901, 3, "2020/04/15 15:00:00", 1, "【物理】前衛でパンチを放つちぇる盛りＭＡＸな女の子。\nクリティカルを出すたびに【ちぇる】を溜め、自己を強化\nし続け、後半になるほど敵をちぇるっとじぇのさいする。", 110901, 450, 0, 1, "2030/12/31 15:00:00", 2.295, 110901, 222, 2, 0, "チエル", 0, 1, 110901, 0, "ちえる");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 111001, 3, "2020/03/31 12:00:00", 7, "【魔法】後衛で、味方の支援に特化した象牙の塔の才媛。\n自身の攻撃力は低いが、物理攻撃力の高い味方を強化し\n更に味方全体を魔法無効バリアで護りつつ勝利へ導く。", 111001, 450, 0, 26, "2030/12/31 15:00:00", 2.27, 111001, 807, 2, 0, "ユニ", 0, 2, 111001, 0, "ゆに");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 111101, 3, "2023/10/23 12:00:00", 7, "【魔法】後衛で味方の火力を高める、黒猫仮装の優等生。\n自分の魔法攻撃力に応じて効果が強化されるものと、\n効果が累積するもの等、多彩なスキルで攻撃力を高める。", 111101, 450, 0, 7, "2023/10/26 11:59:59", 2.07, 111101, 820, 13, 0, "キョウカ（ハロウィン）", 0, 2, 111101, 1, "きょうか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 111201, 1, "2021/08/16 15:00:00", 1, "【物理】前衛で範囲攻撃を放つ、カボチャ衣装の悪戯娘。敵に５カウントで爆発する爆弾を仕掛けたり、カボチャの手榴弾を投げつけたりと、様々な範囲攻撃で敵を弄ぶ。", 111201, 450, 0, 1, "2030/12/31 15:00:00", 2.17, 111201, 212, 13, 0, "ミソギ（ハロウィン）", 0, 1, 111201, 1, "みそぎ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 111301, 3, "2019/10/16 15:00:00", 5, "【物理】中衛の、攻撃に特化した、ぐるぐるうさぎっこ。\n行動頻度は少ないが、高威力の範囲攻撃を放ち、\n味方全体の物理攻撃力を大きく高めるスキルも効果抜群。", 111301, 450, 0, 5, "2030/12/31 15:00:00", 2.0, 111301, 365, 13, 0, "ミミ（ハロウィン）", 0, 1, 111301, 0, "みみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 111401, 3, "2019/10/31 12:00:00", 7, "【魔法】後衛で、死霊術でおともだちを作る可憐な少女。\nルナがダメージを与える度に集まってくるおともだちを、\n各スキルで消費する。消費数に応じ強大な力を発揮する。", 111401, 450, 0, 25, "2030/12/31 15:00:00", 1.87, 111401, 765, 0, 0, "ルナ", 0, 2, 111401, 0, "るな");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 111501, 3, "2023/12/22 12:00:00", 4, "【物理】前衛で戦いを愉しむ、聖夜の『誓約女君』。\nユニオンバーストを使用すると得られるコインの有無で、\n補助と攻撃の二役を切り替え、華麗に敵を斬り倒す。", 111501, 450, 0, 10, "2023/12/27 11:59:59", 2.0, 111501, 265, 13, 0, "クリスティーナ（クリスマス）", 0, 1, 111501, 1, "くりすてぃーな");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 111601, 1, "2021/10/19 15:00:00", 4, "【物理】中衛でパーティの守りを支えるサンタアイドル。\nスキルで物理攻撃を無効化し、後方の味方が多いほど\n物理防御力を高めるユニオンバーストで生存力を高める。", 111601, 450, 0, 4, "2030/12/31 15:00:00", 2.24, 111601, 418, 13, 0, "ノゾミ（クリスマス）", 0, 1, 111601, 1, "のぞみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 111701, 3, "2019/12/20 15:00:00", 3, "【魔法】前衛で、血を対価に敵を攻撃する聖夜の吸血鬼。\n残りＨＰが低い程ダメージが上昇するスキルと、ＨＰを\n消費するスキルを組み合わせ、絶大な破壊力を発揮する。", 111701, 450, 0, 3, "2030/12/31 15:00:00", 1.3, 111701, 255, 13, 0, "イリヤ（クリスマス）", 0, 2, 111701, 0, "いりや");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 111801, 3, "2024/01/26 12:00:00", 4, "【物理】前衛で元気いっぱいに新年を祝う腹ペコお姫様。\n物理攻撃力を高めるスキルで味方を強化し、ＨＰが多い\nほどダメージが上昇するユニオンバーストで敵を討つ。", 111801, 450, 0, 22, "2024/01/31 11:59:59", 1.965, 111801, 248, 13, 0, "ペコリーヌ（ニューイヤー）", 0, 1, 111801, 1, "ぺこりーぬ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 111901, 3, "2024/03/11 12:00:00", 7, "【物理】前衛で、味方の補助に秀でた、新風の巫女。\n物理クリティカル時のダメージアップのスキルで味方の\n殲滅力を高めつつ、挑発や継続回復で耐久面を支える。", 111901, 450, 0, 23, "2024/03/18 11:59:59", 1.87, 111901, 159, 1, 0, "コッコロ（ニューイヤー）", 0, 1, 111901, 1, "こっころ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 112001, 3, "2024/03/11 12:00:00", 7, "【魔法】後衛で、攻防双方で活躍する晴れ着姿の猫娘。\n与ダメージに応じて魔法攻撃力がアップするユニオン\nバーストで、高いベースの攻撃力がさらに強大になる。", 112001, 450, 0, 21, "2024/03/18 11:59:59", 2.07, 112001, 690, 3, 0, "キャル（ニューイヤー）", 0, 2, 112001, 1, "きゃる");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 112101, 1, "2021/11/16 15:00:00", 7, "【魔法】後衛で祈りによるサポートを行うドジっ娘巫女。\nスキルの魔法無効バリアで耐久力を高め、ユニオン\nバーストでＨＰ回復と行動速度アップで戦況を整える。", 112101, 450, 0, 21, "2030/12/31 15:00:00", 2.27, 112101, 722, 1, 0, "スズメ（ニューイヤー）", 0, 2, 112101, 1, "すずめ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 112201, 3, "2020/01/31 12:00:00", 7, "【魔法】後衛の、妨害に特化した能力を持つ魔法探偵。\n相手のＴＰを大きく減少させるスキルや、遠くの敵を\n束縛するスキルを操り、相手の連携を大きく乱す。", 112201, 450, 0, 7, "2030/12/31 15:00:00", 2.27, 112201, 730, 9, 0, "カスミ（マジカル）", 0, 2, 112201, 0, "かすみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 112301, 1, "2021/12/16 15:00:00", 8, "【物理】後衛で味方の火力の底上げを担う魔法狩人。\nユニオンバーストで味方全体の物理攻撃力を大きく高め\nスキルは範囲内の物理攻撃力を高め、輝矢の一撃を放つ。", 112301, 450, 0, 8, "2030/12/31 15:00:00", 1.97, 112301, 712, 5, 0, "シオリ（マジカル）", 0, 1, 112301, 1, "しおり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 112401, 3, "2021/03/08 12:00:00", 4, "【物理】中衛で、味方を鼓舞して戦う、キュートな少女。\n味方をＴＰや攻撃力をアップさせるスキルでサポートし、\n自身も強力な範囲攻撃で敵をなぎ払う。", 112401, 450, 0, 4, "2021/03/24 11:59:59", 2.24, 112401, 370, 18, 0, "ウヅキ（デレマス）", 0, 1, 112401, 1, "うづき");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 112501, 3, "2021/03/08 12:00:00", 4, "【物理】前衛で、氷を創出し味方を護る、クールな少女。\n目の前の敵を束縛するスキルや挑発で行動を妨害し、\n自身にもバリアを展開し、鉄壁の防御能力を発揮する。", 112501, 450, 0, 4, "2021/03/24 11:59:59", 2.215, 112501, 153, 18, 0, "リン（デレマス）", 0, 1, 112501, 1, "りんでれます");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 112601, 1, "2015/04/01 15:00:00", 7, "【魔法】後衛で攻防共に活躍するパッション溢れる少女。\nダメージを受けた味方中心に回復魔法で補助をし、\nさらに魔法攻撃を仕掛けて、敵を一網打尽にする。", 112601, 450, 0, 7, "2030/12/31 15:00:00", 2.27, 112601, 695, 18, 0, "ミオ（デレマス）", 0, 2, 112601, 1, "みお");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 112701, 3, "2020/04/30 12:00:00", 6, "【物理】中衛から、敵の守りを貫くドングリレンジャー。\n戦闘開始と共に範囲内の敵の物理防御力を大幅に下げ、\n序盤から大ダメージを与えられる戦況を作り出す。", 112701, 450, 0, 6, "2030/12/31 15:00:00", 2.19, 112701, 422, 3, 0, "リン（レンジャー）", 0, 1, 112701, 0, "りん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 112801, 3, "2020/05/15 15:00:00", 6, "【物理】中衛で、多勢相手が十八番のまきばの戦士。\n相手を吹き飛ばすスキルを多用し敵の陣形を押し込む。\n範囲攻撃と混乱付与スキルを駆使し一気に殲滅する。", 112801, 450, 0, 6, "2030/12/31 15:00:00", 2.19, 112801, 390, 5, 0, "マヒル（レンジャー）", 0, 1, 112801, 0, "まひる");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 112901, 3, "2020/06/03 19:00:00", 8, "【物理】後衛で、希望の力で戦う、不思議の国の救世主。\nクリティカルすると効果アップのスキルや味方の数が多い\n程、威力がアップするユニオンバーストで敵を殲滅する。", 112901, 450, 0, 8, "2030/12/31 15:00:00", 1.97, 112901, 730, 6, 0, "リノ（ワンダー）", 0, 1, 112901, 0, "りの");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 113001, 1, "2020/05/31 12:00:00", 6, "【物理】中衛で、戦場の動向を自在に操る白兎の乙女。\n敵の行動速度をダウンさせ、味方の速度をアップさせる\nスキルと敵の時を止めるスキルで、常に味方を支える。", 113001, 450, 0, 6, "2030/12/31 15:00:00", 2.34, 113001, 508, 12, 0, "アユミ（ワンダー）", 0, 1, 113001, 1, "あゆみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 113101, 3, "2024/07/23 12:00:00", 27, "【物理】前衛で、流麗な太刀捌きを魅せる若夏の姉御。\nダメージを与えた回数に応じて攻撃力が高まるスキルと、\n携えた二刀の幾刃もの斬撃で、眼前の敵を薙ぎ払う。", 113101, 450, 0, 27, "2024/07/31 11:59:59", 1.3, 113101, 192, 6, 0, "ルカ（サマー）", 0, 1, 113101, 1, "るか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 113201, 1, "2022/04/18 15:00:00", 5, "【魔法】前衛で皆の力を借り受け力を振るう真夏の冥姫。\n味方全体の魔法攻撃力を代償に自身の魔法攻撃力を劇的に\n高め、熾烈な攻撃魔法を繰り出し大ダメージを与える。", 113201, 450, 0, 28, "2030/12/31 15:00:00", 1.625, 113201, 256, 12, 0, "アンナ（サマー）", 0, 2, 113201, 1, "あんな");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 113301, 3, "2020/07/15 15:00:00", 7, "【魔法】中衛の多勢相手の戦いが得意な真夏の魔法少女。\n敵の数に応じて効果が上昇する防御力ダウンのスキルや、\n多彩な範囲攻撃を操り、真夏の戦いをサイカワに制する。", 113301, 450, 0, 7, "2030/12/31 15:00:00", 2.07, 113301, 468, 12, 0, "ナナカ（サマー）", 0, 2, 113301, 0, "ななか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 113401, 3, "2024/07/23 12:00:00", 7, "【魔法】中衛から全体魔法攻撃を放つ超能力チアガール。\nユニオンバーストで敵全体に絶大な一撃を放ち、\nその後、超能力発動の反動で枕を抱えて夢の中へ。", 113401, 450, 0, 29, "2024/07/31 11:59:59", 1.92, 113401, 567, 12, 0, "ハツネ（サマー）", 0, 2, 113401, 1, "はつね");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 113501, 1, "2022/05/18 15:00:00", 7, "【魔法】後衛で、敵の脅威から生徒を守る夏女神な先生。\n味方の魔法防御力を高め、ＨＰを継続回復するスキルや、\nバリア展開のユニオンバーストで味方を堅固に守護する。", 113501, 450, 0, 7, "2030/12/31 15:00:00", 2.07, 113501, 697, 12, 0, "ミサト（サマー）", 0, 2, 113501, 1, "みさと");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 113601, 3, "2020/08/15 15:00:00", 5, "【物理】前衛で、業火を従え悪を討つ真夏の騎士団長。\n敵単体にダメージを与えつつ、攻撃力を高めるユニオン\nバーストや、火傷を与えるスキルを操り敵を焼き尽くす。", 113601, 450, 0, 5, "2030/12/31 15:00:00", 2.0, 113601, 182, 12, 0, "ジュン（サマー）", 0, 1, 113601, 0, "じゅん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 113701, 3, "2020/09/03 19:00:00", 7, "【魔法】中衛で、魔法攻撃をお見舞いする双子の妹天使。\n効果時間が短い分、絶大な効果の強化魔法で自身の攻撃力\nを大きく高め、威力抜群の単体魔法で敵を一掃する。", 113701, 450, 0, 7, "2030/12/31 15:00:00", 1.92, 113701, 530, 12, 0, "アカリ（エンジェル）", 0, 2, 113701, 0, "あかり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 113801, 3, "2020/09/19 15:00:00", 6, "【魔法】中衛で、補助魔法で味方を助ける双子の姉天使。\n防御力を大幅に高めつつ、対象の味方に敵の注意を引か\nせるなど、特殊で強力なスキルを駆使し敵を翻弄する。", 113801, 450, 0, 6, "2030/12/31 15:00:00", 2.34, 113801, 531, 12, 0, "ヨリ（エンジェル）", 0, 2, 113801, 0, "より");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 113901, 3, "2023/10/23 12:00:00", 2, "【物理】前衛で敵の物理攻撃を妨害する吸血鬼テーラー。\n挑発と物理無効バリア、さらに最も物理攻撃力が高い敵を\n狙った妨害スキルによって、鉄壁の防御を織り上げる。", 113901, 450, 0, 2, "2023/10/26 11:59:59", 2.375, 113901, 152, 12, 0, "ツムギ（ハロウィン）", 0, 1, 113901, 1, "つむぎ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 114001, 3, "2020/10/15 15:00:00", 4, "【物理】中衛で、手負いの敵を死に誘う、幽雅の剣士。\nＨＰが50％未満の敵に対し放つと、威力が大アップする\n範囲攻撃を繰り出し負傷した敵の戦意を一気に叩き折る。", 114001, 450, 0, 4, "2030/12/31 15:00:00", 1.965, 114001, 375, 12, 0, "レイ（ハロウィン）", 0, 1, 114001, 0, "れい");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 114101, 1, "2022/07/19 8:00:00", 1, "【物理】前衛で鋭爪を突き立てるハロウィン騎士見習い。\nユニオンバーストの使用回数に応じて強化されるスキルで\n与えるダメージと行動速度をアップさせ、敵を斬り裂く。", 114101, 450, 0, 1, "2030/12/31 15:00:00", 2.295, 114101, 186, 12, 0, "マツリ（ハロウィン）", 0, 1, 114101, 1, "まつり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 114201, 3, "2020/10/31 12:00:00", 4, "【物理】中衛で愛と希望の力を胸に指揮を執る魔法提督。\nユニオンバーストで敵単体の物理防御力を下げ、範囲内の\n味方の物理攻撃力アップスキルで、一気に戦況を決める。", 114201, 450, 0, 4, "2030/12/31 15:00:00", 2.24, 114201, 528, 12, 0, "モニカ（マジカル）", 0, 1, 114201, 0, "もにか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 114301, 3, "2020/11/21 15:00:00", 4, "【物理】中衛で正義の力を魔法にのせて戦う魔法剣士。\n自身の物理攻撃力を魔法攻撃力に加える魔法少女の力と、\nたゆまぬ努力で獲得した剣技で、華麗な魔法攻撃を放つ。", 114301, 450, 0, 4, "2030/12/31 15:00:00", 2.0, 114301, 402, 2, 0, "トモ（マジカル）", 0, 1, 114301, 0, "とも");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 114401, 3, "2023/12/22 12:00:00", 5, "【物理】前衛で味方のサポートを力に戦う、聖夜の令嬢。\nステータスアップ効果を受けると増加する【聖夜の煌き】\nでスキルを大きく強化し、聖夜を彩る強烈な一撃を放つ。", 114401, 450, 0, 5, "2023/12/27 11:59:59", 2.0, 114401, 189, 2, 0, "アキノ（クリスマス）", 0, 1, 114401, 1, "あきの");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 114501, 3, "2020/12/21 15:00:00", 4, "【物理】前衛で、光を操り味方を守る聖夜のサレンママ。\n敵の攻撃を防ぎ、ダメージを与えるユニオンバーストや、\nダメージを与えつつ回復するスキルで、攻守双方を担う。", 114501, 450, 0, 4, "2030/12/31 15:00:00", 2.09, 114501, 150, 3, 0, "サレン（クリスマス）", 0, 1, 114501, 0, "されん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 114601, 1, "2022/09/17 15:00:00", 5, "【物理】中衛で物理キャラを支援し戦う聖夜の元聖騎士。\n魔法攻撃力の高い敵単体のＴＰ減少や周囲の味方の魔法\n防御力アップスキルで、対魔法戦で無類の輝きを放つ。", 114601, 450, 0, 5, "2030/12/31 15:00:00", 2.09, 114601, 408, 2, 0, "ユカリ（クリスマス）", 0, 1, 114601, 1, "ゆかり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 114701, 1, "2022/10/16 15:00:00", 2, "【物理】前衛で、新風纏う「天楼覇断剣」を振るう少女。\n皆より一足遅れて突撃し、敵の前衛を吹き飛ばした後、\n強化した範囲物理攻撃で、ダンゴになった敵を斬り払う。", 114701, 450, 0, 31, "2030/12/31 15:00:00", 2.0, 114701, 138, 2, 0, "ムイミ（ニューイヤー）", 0, 1, 114701, 1, "むいみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 115001, 3, "2024/01/26 12:00:00", 7, "【魔法】中衛で艶やかな晴れ着を身に纏う『変貌大妃』。\n味方の魔法攻撃力アップやＨＰ、ＴＰを回復させるスキル\nで攻守にわたってサポートし苛烈な戦況でも勝利に導く。", 115001, 450, 0, 21, "2024/01/31 11:59:59", 2.07, 115001, 562, 2, 0, "ネネカ（ニューイヤー）", 0, 2, 115001, 1, "ねねか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 115501, 3, "2024/01/22 12:00:00", 2, "【物理】中衛で、尊き儀装束を纏うエルフの里の巫女。\n自分の攻撃力を強化し、さらにＴＰ回復で攻撃の手数を\n増やす。クリティカル時の猛攻で仲間を守る剣となる。", 115501, 450, 0, 2, "2024/01/26 11:59:59", 2.0, 115501, 533, 1, 0, "コッコロ（儀装束）", 0, 1, 115501, 1, "こっころ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 115601, 1, "2022/11/17 15:00:00", 7, "【魔法】中衛で精霊術を操り味方を支える儀装の魔法士。\n複数の物理攻撃力の強化スキルで味方を攻撃支援しつつ\n強力な回復スキルで、前線を整えバトルを掌握する。", 115601, 450, 0, 7, "2030/12/31 15:00:00", 1.97, 115601, 578, 7, 0, "ユイ（儀装束）", 0, 2, 115601, 1, "ゆい");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 115701, 3, "2021/02/23 15:00:00", 7, "【魔法】後衛で、敵の防御力を削ぎ取る渚の名探偵。\n攻撃力が高い敵に目標を定めて防御力を下げつつ、\n味方を強化するスキルで、どんな難事件も解決へと導く。", 115701, 450, 0, 7, "2030/12/31 15:00:00", 2.27, 115701, 738, 9, 0, "カスミ（サマー）", 0, 2, 115701, 0, "かすみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 116101, 0, 115801, 1, "2022/12/19 15:00:00", 4, "【物理】前衛の魔法の果実でお姫様姿になった恋乙女。\n獣の姿からユニオンバーストで一定時間、人の姿に変身し\n味方全体の攻撃力アップスキルで、火力の底上げをする。", 115801, 450, 0, 4, "2030/12/31 15:00:00", 2.27, 115801, 173, 5, 0, "リマ（シンデレラ）", 0, 1, 115801, 1, "りま");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 115901, 3, "2021/03/03 19:00:00", 5, "【物理】前衛で、華装に身を包み流麗な剣舞を舞う狼娘。\n周囲の味方の数に応じて、スキルの威力と物理攻撃力\nアップのスキル効果が上がり、鼓舞激励の一斬を振るう。", 115901, 450, 0, 5, "2030/12/31 15:00:00", 2.27, 115901, 166, 4, 0, "マコト（シンデレラ）", 0, 1, 115901, 0, "まこと");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 116001, 3, "2021/03/22 15:00:00", 7, "【魔法】後衛から、優雅に味方を支援するマホ先生。\n物理攻撃をする味方の攻撃力アップや、最遠の味方のＴＰ\nを回復するスキルで、しゃなりしゃなりと戦況を変える。", 116001, 450, 0, 7, "2030/12/31 15:00:00", 2.27, 116001, 645, 9, 0, "マホ（シンデレラ）", 0, 2, 116001, 0, "まほ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 116201, 3, "2021/04/15 15:00:00", 2, "【物理】前衛で疾風の如く駆け抜ける、ダウナー女子。\n特定回数ダメージを与えるたびＴＰを全回復するスキルと\n発動ごとに攻撃力アップのスキルで勝利のテープを掴む。", 116201, 450, 0, 2, "2030/12/31 15:00:00", 2.125, 116201, 184, 2, 0, "クロエ（聖学祭）", 0, 1, 116201, 0, "くろえ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 116301, 3, "2021/03/31 12:00:00", 1, "【物理】前衛で聖学祭を盛りアゲる、はぴちぇる系女子。\n攻撃ヒットのたびに【ちぇる】を貯め、威力が増すスキル\nと味方全体の物理攻撃力アップ効果のＵＢで勝利に導く。", 116301, 450, 0, 32, "2030/12/31 15:00:00", 2.295, 116301, 223, 2, 0, "チエル（聖学祭）", 0, 1, 116301, 0, "ちえる");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 116401, 3, "2022/02/08 12:00:00", 7, "【魔法】後衛から、仲間を啓蒙するユニちゃんズの才媛。\n自分以外の味方全員の物理・魔法両方の攻撃力アップと\nクリティカル時のダメージアップで皆を勝利へと導く。", 116401, 450, 0, 39, "2030/12/31 15:00:00", 2.27, 116401, 808, 2, 0, "ユニ（聖学祭）", 0, 2, 116401, 0, "ゆに");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 116501, 3, "2021/04/30 12:00:00", 3, "【物理】前衛で威勢よく、まくしたてる口撃系ドラゴン。\n全体物理攻撃力アップのＵＢは、味方の防御力を下げる\n代わりにＨＰが多いほど効果を高め、味方を勝利に導く。", 116501, 450, 0, 3, "2030/12/31 15:00:00", 2.295, 116501, 252, 17, 0, "イノリ（タイムトラベル）", 0, 1, 116501, 0, "いのり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 116601, 3, "2021/05/21 15:00:00", 1, "【物理】前衛で味方を勝利にナビする喧嘩屋ドラゴン族。\nユニオンバーストで自身の攻撃速度を極大アップさせ、\n物理攻撃力アップスキルのシナジーで拳の雨を降らせる。", 116601, 450, 0, 1, "2030/12/31 15:00:00", 2.295, 116601, 169, 17, 0, "カヤ（タイムトラベル）", 0, 1, 116601, 0, "かや");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 116701, 3, "2021/05/31 12:00:00", 33, "【物理】中衛で敵を妨害する、作業服姿のぼっちエルフ。\n友情の絆で結ばれた『マイフレンドくん』と放つＵＢは、\n敵の動きを阻み、物理防御力を劇的に下げる。", 116701, 450, 0, 33, "2030/12/31 15:00:00", 1.82, 116701, 527, 9, 0, "アオイ（作業服）", 0, 1, 116701, 0, "あおい");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 116801, 1, "2023/03/16 15:00:00", 2, "【物理】前衛でたい焼き器片手に悪を討つ売り子の猫娘。\n味方全体を物理攻撃力アップとＴＰ回復させ、ＵＢでさら\nに自分の攻撃力を特大強化し、驚異の威力を発揮する。", 116801, 450, 0, 2, "2030/12/31 15:00:00", 2.295, 116801, 216, 8, 0, "タマキ（作業服）", 0, 1, 116801, 1, "たまき");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 116901, 3, "2021/06/16 15:00:00", 6, "【物理】前衛で、皆の盾となり進攻するバイトリーダー。\nバトル序盤は物理の攻防両方をスキルで強化。ＵＢ発動毎\nに自分のクリティカルをアップし猛烈な攻撃を繰り出す。", 116901, 450, 0, 6, "2030/12/31 15:00:00", 2.065, 116901, 275, 8, 0, "ミフユ（作業服）", 0, 1, 116901, 0, "みふゆ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 117001, 3, "2023/08/26 12:00:00", 3, "【物理】中衛で、火花を纏い夕闇を彩る真夏の壊し屋。\n二つのスキルで物理防御力を下げ、ダメージ量に応じて\nクリティカル上昇が延長するＵＢで眼前の敵を粉砕する。", 117001, 450, 0, 3, "2023/08/31 11:59:59", 1.55, 117001, 407, 11, 0, "エリコ（サマー）", 0, 1, 117001, 1, "えりこ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 117101, 3, "2021/07/15 12:00:00", 5, "【物理】前衛で、堅牢に仲間を守る海辺のお姉ちゃん。\n物理防御力が高い程、効果が高まる複数のスキルを巧みに\n操り防御と補助役をしつつ範囲攻撃で攻撃役をもこなす。", 117101, 450, 0, 5, "2030/12/31 15:00:00", 2.0, 117101, 163, 6, 0, "シズル（サマー）", 0, 1, 117101, 0, "しずる");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 117201, 3, "2023/08/26 12:00:00", 4, "【物理】中衛でみんなを応援する真夏のトップアイドル。\nすべてのスキルで味方全体の物理攻撃をサポートし、\nバトル中盤から味方全体のＴＰ回復で、皆を勝利に導く。", 117201, 450, 0, 4, "2023/08/31 11:59:59", 2.09, 117201, 417, 10, 0, "ノゾミ（サマー）", 0, 1, 117201, 1, "のぞみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 117301, 3, "2021/08/15 15:00:00", 7, "【魔法】中衛で、守護の賛歌を捧げる夏海の歌姫。\n最序盤に味方の魔法防御を大幅に強化し、吸収バリアや\nＨＰ回復スキルで、如何なる猛攻からも味方を守る。", 117301, 450, 0, 7, "2030/12/31 15:00:00", 2.07, 117301, 520, 10, 0, "チカ（サマー）", 0, 2, 117301, 0, "ちか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 117401, 1, "2023/05/16 15:00:00", 1, "【物理】中衛で敵を引き寄せ陣形を崩す夕凪のテーラー。\n最も攻撃力の高い敵を、敵陣から自陣に引き寄せつつ\n束縛や行動速度ダウンを絡めたスキルで敵の自由を縛る。", 117401, 450, 0, 1, "2030/12/31 15:00:00", 2.42, 117401, 355, 10, 0, "ツムギ（サマー）", 0, 1, 117401, 1, "つむぎ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 117501, 3, "2021/09/03 19:00:00", 5, "【物理】中衛で、戦況のすべてを見据える隻眼の闇医者。\nＨＰが低い敵を束縛し防御力ダウンスキルで仕掛けつつ\n呪詛の毎秒増加する継続ダメージで敵の命を刻々と蝕む。", 117501, 450, 0, 5, "2030/12/31 15:00:00", 2.4, 117501, 552, 11, 0, "ミツキ（オーエド）", 0, 1, 117501, 0, "みつき");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 117601, 3, "2021/09/13 12:00:00", 7, "【魔法】後衛で、迷える皆を救う白衣を纏いし美の象徴。\n一番低い味方１キャラのＴＰを回復し、ＨＰ回復スキルで\n守り、魔法攻撃力アップのスキルで一気に攻め落とす。", 117601, 450, 0, 7, "2030/12/31 15:00:00", 2.0, 117601, 798, 12, 0, "ユキ（オーエド）", 0, 2, 117601, 0, "ゆき");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 117701, 3, "2023/10/23 12:00:00", 1, "【物理】前衛の敵を追い詰める程、力を増す幽玄南国娘。\n敵の体力が少ない程、効果が高まる攻撃力アップスキルと\nダメージ量アップの攻撃スキルで、敵を逃さず仕留める。", 117701, 450, 0, 1, "2023/10/26 11:59:59", 2.17, 117701, 156, 4, 0, "カオリ（ハロウィン）", 0, 1, 117701, 1, "かおり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 117801, 1, "2023/07/18 15:00:00", 36, "【物理】中衛で物理攻撃タイプの味方を強化するシノビ。\n味方の物理攻撃力アップや行動速度アップのスキル効果で\n味方全体の攻撃力を底上げし、勝利の笛を吹きならす。", 117801, 450, 0, 36, "2030/12/31 15:00:00", 2.25, 117801, 518, 12, 0, "ニノン（ハロウィン）", 0, 1, 117801, 1, "にのん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 117901, 3, "2021/10/15 15:00:00", 8, "【物理】後衛でアタッカーを狙う小悪魔カリスマモデル。\n誘惑状態だと威力アップの攻撃スキルや、ＴＰを奪い取る\n妨害スキルを放ち、物理攻撃力が最も高い敵を狙い撃つ。", 117901, 450, 0, 8, "2030/12/31 15:00:00", 1.97, 117901, 761, 15, 0, "スズナ（ハロウィン）", 0, 1, 117901, 0, "すずな");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 118001, 3, "2023/09/12 12:00:00", 35, "【物理】後衛で、攻撃と敵の弱体化の二役で輝く女商人。\n生ける金貨が詰まった財布を投げつける不意打ちや、\n金貨の嵐を巻き起こす攻撃で、相手の防御を大きく崩す。", 118001, 450, 0, 35, "2023/09/15 14:59:59", 1.97, 118001, 751, 0, 0, "クレジッタ", 0, 1, 118001, 1, "くれじった");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 118101, 3, "2024/06/30 12:00:00", 7, "【魔法】後衛で、美しい旋律を紡ぎ支援する幽寂の歌姫。\n味方の強化と敵の弱体化の両方面での補助を行い、さらに\n召喚した鉱石の飛竜との波状攻撃により敵を鎮圧する。", 118101, 450, 0, 21, "2024/07/03 18:59:59", 2.07, 118101, 782, 19, 0, "ランファ", 0, 2, 118101, 1, "らんふぁ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 118201, 3, "2024/06/30 12:00:00", 0, "【魔法】後衛で笑顔とともに破壊を振りまく溌溂少女★\n最大３体に着弾するスキルとＵＢは【PSI★チャージ】\n状態で魔防ダウン効果を追加し、邪魔者たちを殲滅する。", 118201, 450, 0, 0, "2024/07/03 18:59:59", 1.7, 118201, 730, 19, 0, "ミソラ", 0, 2, 118201, 1, "みそら");
