INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 0, 3, "2015/04/01 15:00:00", 0, "", 0, 0, 0, 0, "2030/12/31 15:00:00", 0.0, 118401, 732, 0, 180701, "シオリ（ハツネ&シオリ）", 0, 0, 118401, 1, "しおり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 118501, 1, "2021/10/19 12:00:00", 37, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 118501, 450, 0, 37, "2030/12/31 15:00:00", 2.0, 118501, 787, 0, 0, "カリン", 0, 2, 118501, 1, "かりん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 118601, 3, "2024/08/10 21:00:00", 0, "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", 118601, 450, 0, 0, "2030/12/31 15:00:00", 2.0, 118601, 826, 0, 0, "ネビア", 0, 2, 118601, 1, "ねびあ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 119001, 3, "2021/11/03 19:00:00", 7, "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", 119001, 450, 0, 7, "2030/12/31 15:00:00", 2.27, 119001, 714, 15, 0, "イオ（ノワール）", 0, 2, 119001, 0, "いお");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 119101, 3, "2021/11/16 12:00:00", 7, "【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", 119101, 450, 0, 26, "2030/12/31 15:00:00", 2.545, 119101, 143, 12, 0, "クウカ（ノワール）", 0, 2, 119101, 0, "くうか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 119201, 1, "2023/09/19 15:00:00", 6, "【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。", 119201, 450, 0, 6, "2030/12/31 15:00:00", 2.19, 119201, 397, 5, 0, "マヒル（クリスマス）", 0, 1, 119201, 1, "まひる");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 119301, 3, "2021/12/22 12:00:00", 8, "【物理】後衛で、攻撃と支援を担う聖夜のアーチャー。\n物理攻撃力と物理クリティカルアップスキルで周囲を強化\nし、クリティカルで威力が増大するＵＢで敵を粉砕する。", 119301, 450, 0, 8, "2030/12/31 15:00:00", 1.97, 119301, 762, 6, 0, "リノ（クリスマス）", 0, 1, 119301, 0, "りの");
