INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 120701, 3, "2024/01/26 12:00:00", 4, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 120701, 450, 0, 22, "2024/01/31 11:59:59", 1.84, 120701, 283, 1, 0, "シェフィ（ニューイヤー）", 0, 1, 120701, 1, "しぇふぃ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 120801, 1, "2023/10/16 15:00:00", 4, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 120801, 450, 0, 22, "2030/12/31 15:00:00", 1.3, 120801, 193, 2, 0, "ルカ（ニューイヤー）", 0, 1, 120801, 1, "るか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 120901, 3, "2024/01/26 12:00:00", 3, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 120901, 450, 0, 38, "2024/01/31 11:59:59", 1.425, 120901, 424, 12, 0, "イリヤ（ニューイヤー）", 0, 2, 120901, 1, "いりや");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 121001, 3, "2024/02/22 12:00:00", 5, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 121001, 450, 0, 41, "2024/02/29 11:59:59", 2.25, 121001, 164, 1, 0, "ペコリーヌ（オーバーロード）", 0, 1, 121001, 1, "ぺこりーぬ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 121101, 3, "2024/02/22 12:00:00", 7, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 121101, 450, 0, 42, "2024/02/29 11:59:59", 2.07, 121101, 588, 1, 0, "キャル（オーバーロード）", 0, 2, 121101, 1, "きゃる");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 121201, 1, "2023/11/16 15:00:00", 4, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 121201, 450, 0, 40, "2030/12/31 15:00:00", 1.55, 121201, 260, 6, 0, "ラビリスタ（オーバーロード）", 0, 1, 121201, 1, "らびりすた");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 121301, 3, "2022/03/03 19:00:00", 3, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 121301, 450, 0, 3, "2030/12/31 15:00:00", 1.9, 121301, 731, 3, 0, "クルミ（ステージ）", 0, 1, 121301, 0, "くるみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 121401, 3, "2022/03/15 15:00:00", 7, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 121401, 450, 0, 7, "2030/12/31 15:00:00", 2.27, 121401, 742, 15, 0, "ミサキ（ステージ）", 0, 2, 121401, 0, "みさき");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 121501, 3, "2024/04/12 12:00:00", 6, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 121501, 450, 0, 6, "2024/04/15 14:59:59", 2.0, 121501, 590, 12, 0, "アユミ（怪盗）", 0, 1, 121501, 1, "あゆみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 121601, 3, "2022/04/15 15:00:00", 3, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 121601, 450, 0, 3, "2030/12/31 15:00:00", 1.425, 121601, 292, 17, 0, "イノリ（怪盗）", 0, 1, 121601, 0, "いのり");
