INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 0, 3, "2015/04/01 15:00:00", 0, "", 0, 0, 0, 0, "2030/12/31 15:00:00", 0.0, 121801, 421, 0, 180901, "サレン（アキノ＆サレン）", 0, 0, 121801, 1, "されん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 121901, 3, "2022/05/15 15:00:00", 5, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", 121901, 450, 0, 5, "2030/12/31 15:00:00", 2.125, 121901, 293, 12, 0, "アンナ（パイレーツ）", 0, 2, 121901, 0, "あんな");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 122001, 3, "2022/05/03 19:00:00", 3, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 122001, 450, 0, 3, "2030/12/31 15:00:00", 1.425, 122001, 380, 14, 0, "シノブ（パイレーツ）", 0, 1, 122001, 0, "しのぶ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 122101, 1, "2024/04/18 15:00:00", 35, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 122101, 450, 0, 35, "2030/12/31 15:00:00", 1.97, 122101, 731, 9, 0, "アオイ（キャンプ）", 0, 1, 122101, 1, "あおい");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 122201, 3, "2022/05/31 12:00:00", 4, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", 122201, 450, 0, 4, "2030/12/31 15:00:00", 1.84, 122201, 419, 8, 0, "ユカリ（キャンプ）", 0, 1, 122201, 0, "ゆかり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 122301, 3, "2022/06/15 15:00:00", 43, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 122301, 450, 0, 43, "2030/12/31 15:00:00", 1.425, 122301, 564, 0, 0, "ヴァンピィ", 0, 2, 122301, 0, "うぁんぴぃ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 122401, 1, "2024/06/17 15:00:00", 1, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", 122401, 450, 0, 1, "2030/12/31 15:00:00", 2.42, 122401, 264, 8, 0, "ヒヨリ（サマー）", 0, 1, 122401, 1, "ひより");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 122501, 3, "2023/07/12 12:00:00", 4, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", 122501, 450, 0, 4, "2023/07/15 14:59:59", 1.965, 122501, 250, 0, 0, "レイ（サマー）", 0, 1, 122501, 1, "れい");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 122601, 3, "2022/07/15 15:00:00", 7, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", 122601, 450, 0, 7, "2030/12/31 15:00:00", 2.27, 122601, 554, 0, 0, "ユイ（サマー）", 0, 2, 122601, 0, "ゆい");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 122701, 3, "2022/08/15 15:00:00", 7, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 122701, 450, 0, 7, "2030/12/31 15:00:00", 1.92, 122701, 812, 0, 0, "キョウカ（サマー）", 0, 2, 122701, 0, "きょうか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 122801, 1, "2024/07/16 15:00:00", 1, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 122801, 450, 0, 1, "2030/12/31 15:00:00", 2.295, 122801, 237, 0, 0, "ミソギ（サマー）", 0, 1, 122801, 1, "みそぎ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 122901, 3, "2023/08/09 12:00:00", 5, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 122901, 450, 0, 5, "2023/08/12 11:59:59", 2.25, 122901, 361, 0, 0, "ミミ（サマー）", 0, 1, 122901, 1, "みみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 123001, 3, "2024/06/30 12:00:00", 44, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", 123001, 450, 0, 44, "2024/07/03 18:59:59", 2.27, 123001, 746, 0, 0, "アメス", 0, 2, 123001, 1, "あめす");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 123101, 3, "2022/09/03 19:00:00", 7, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 123101, 450, 0, 7, "2030/12/31 15:00:00", 1.795, 123101, 793, 0, 0, "マホ（エクスプローラー）", 0, 2, 123101, 0, "まほ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 123201, 3, "2022/09/15 15:00:00", 3, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 123201, 450, 0, 3, "2030/12/31 15:00:00", 1.425, 123201, 256, 0, 0, "アヤネ（エクスプローラー）", 0, 1, 123201, 0, "あやね");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 123301, 3, "2023/09/12 12:00:00", 1, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", 123301, 450, 0, 0, "2023/09/15 14:59:59", 1.62, 123301, 350, 0, 0, "ネア", 0, 1, 123301, 1, "ねあ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 0, 3, "2015/04/01 15:00:00", 5, "", 0, 0, 0, 5, "2030/12/31 15:00:00", 0.0, 123401, 0, 0, 0, "ジュン（キャンプ）", 0, 0, 123401, 0, "じゅん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 123501, 1, "2022/09/30 12:00:00", 6, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", 123501, 450, 0, 6, "2030/12/31 15:00:00", 2.34, 123501, 583, 0, 0, "リン（ハロウィン）", 0, 1, 123501, 1, "りん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 123601, 3, "2023/10/10 12:00:00", 4, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", 123601, 450, 0, 4, "2023/10/15 14:59:59", 1.965, 123601, 262, 0, 0, "トモ（ハロウィン）", 0, 1, 123601, 1, "とも");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 123701, 3, "2022/10/15 15:00:00", 7, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", 123701, 450, 0, 21, "2030/12/31 15:00:00", 2.07, 123701, 741, 0, 0, "ナナカ（ハロウィン）", 0, 2, 123701, 0, "ななか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 123801, 3, "2023/11/10 12:00:00", 1, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", 123801, 450, 0, 1, "2023/11/15 14:59:59", 2.295, 123801, 238, 0, 0, "クリスティーナ（ワイルド）", 0, 1, 123801, 1, "くりすてぃーな");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 123901, 3, "2022/11/15 15:00:00", 2, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", 123901, 450, 0, 2, "2030/12/31 15:00:00", 2.125, 123901, 183, 0, 0, "マツリ（ワイルド）", 0, 1, 123901, 0, "まつり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 124001, 3, "2023/12/11 12:00:00", 7, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", 124001, 450, 0, 7, "2023/12/15 14:59:59", 2.07, 124001, 438, 0, 0, "アカリ（クリスマス）", 0, 2, 124001, 1, "あかり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 124101, 1, "2022/11/30 12:00:00", 6, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", 124101, 450, 0, 6, "2030/12/31 15:00:00", 1.965, 124101, 433, 0, 0, "ヨリ（クリスマス）", 0, 2, 124101, 1, "より");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 124201, 3, "2022/12/23 12:00:00", 5, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", 124201, 450, 0, 5, "2030/12/31 15:00:00", 2.07, 124201, 144, 0, 0, "ジュン（クリスマス）", 0, 1, 124201, 0, "じゅん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 0, 3, "2015/04/01 15:00:00", 0, "", 0, 0, 0, 0, "2030/12/31 15:00:00", 0.0, 124301, 577, 0, 181001, "アン（アン＆グレア）", 0, 0, 124301, 1, "あん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 0, 3, "2015/04/01 15:00:00", 0, "", 0, 0, 0, 0, "2030/12/31 15:00:00", 0.0, 124401, 577, 0, 181001, "グレア（アン＆グレア）", 0, 0, 124401, 1, "ぐれあ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 124501, 3, "2024/01/12 12:00:00", 7, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", 124501, 450, 0, 21, "2024/01/15 14:59:59", 2.07, 124501, 707, 0, 0, "ホマレ（ニューイヤー）", 0, 2, 124501, 1, "ほまれ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 124601, 3, "2024/01/12 12:00:00", 7, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", 124601, 450, 0, 21, "2024/01/15 14:59:59", 2.44, 124601, 698, 0, 0, "ミサト（ニューイヤー）", 0, 2, 124601, 1, "みさと");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 124701, 1, "2022/12/31 12:00:00", 7, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", 124701, 450, 0, 46, "2030/12/31 15:00:00", 2.24, 124701, 590, 0, 0, "ミツキ（ニューイヤー）", 0, 1, 124701, 1, "みつき");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 124801, 3, "2024/02/12 12:00:00", 4, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 124801, 450, 0, 0, "2024/02/14 23:59:59", 2.14, 124801, 423, 0, 0, "ノゾミ（リベレイター）", 0, 1, 124801, 1, "のぞみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 124901, 1, "2023/01/31 12:00:00", 1, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", 124901, 450, 0, 0, "2030/12/31 15:00:00", 1.965, 124901, 170, 0, 0, "カヤ（リベレイター）", 0, 1, 124901, 1, "かや");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 125001, 3, "2024/02/12 12:00:00", 5, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 125001, 450, 0, 0, "2024/02/14 23:59:59", 1.965, 125001, 221, 0, 0, "ムイミ（リベレイター）", 0, 1, 125001, 1, "むいみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 125101, 3, "2023/03/03 19:00:00", 8, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 125101, 450, 0, 47, "2030/12/31 15:00:00", 2.24, 125101, 825, 0, 0, "タマキ（カフェ）", 0, 1, 125101, 0, "たまき");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 125201, 3, "2023/03/10 12:00:00", 4, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 125201, 450, 0, 4, "2030/12/31 15:00:00", 1.965, 125201, 463, 0, 0, "モニカ（カフェ）", 0, 1, 125201, 0, "もにか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 125301, 3, "2024/04/12 12:00:00", 6, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 125301, 450, 0, 6, "2024/04/15 14:59:59", 2.07, 125301, 752, 0, 0, "コッコロ（レンジャー）", 0, 1, 125301, 1, "こっころ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 125401, 3, "2023/04/10 12:00:00", 8, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 125401, 450, 0, 8, "2030/12/31 15:00:00", 2.09, 125401, 710, 0, 0, "シオリ（レンジャー）", 0, 1, 125401, 0, "しおり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 125501, 3, "2024/05/10 12:00:00", 7, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 125501, 450, 0, 50, "2024/05/15 14:59:59", 1.92, 125501, 443, 0, 0, "ジータ（ウォーロック）", 0, 2, 125501, 1, "じーた");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 125601, 3, "2024/05/10 12:00:00", 51, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 125601, 450, 0, 0, "2024/05/15 14:59:59", 2.09, 125601, 267, 0, 0, "ビカラ", 0, 1, 125601, 1, "びから");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 125701, 1, "2023/04/30 12:00:00", 7, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 125701, 450, 0, 9, "2030/12/31 15:00:00", 2.24, 125701, 579, 0, 0, "カリン（アルケミスト）", 0, 2, 125701, 1, "かりん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 125801, 3, "2023/04/17 12:00:00", 3, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 125801, 450, 0, 0, "2030/12/31 15:00:00", 2.09, 125801, 464, 0, 0, "リリ（フォールン）", 0, 1, 125801, 0, "りり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 0, 3, "2015/04/01 15:00:00", 1, "", 0, 0, 0, 1, "2030/12/31 15:00:00", 0.0, 125901, 0, 0, 0, "カヤ（リベレイター）", 0, 0, 125901, 1, "かや");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 126001, 3, "2023/10/31 12:00:00", 0, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 126001, 450, 0, 0, "2030/12/31 15:00:00", 2.09, 126001, 406, 0, 0, "クリア（フォールン）", 0, 1, 126001, 0, "くりあ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 126101, 3, "2023/11/15 15:00:00", 44, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 126101, 450, 0, 53, "2030/12/31 15:00:00", 2.09, 126101, 480, 0, 0, "プレシア（フォールン）", 0, 2, 126101, 0, "ぷれしあ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 126201, 3, "2024/06/10 12:00:00", 3, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 126201, 450, 0, 3, "2024/06/15 14:59:59", 2.09, 126201, 568, 0, 0, "イリヤ（儀装束）", 0, 2, 126201, 1, "いりや");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 126301, 3, "2023/06/15 15:00:00", 7, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 126301, 450, 0, 9, "2030/12/31 15:00:00", 2.07, 126301, 456, 0, 0, "ユキ（儀装束）", 0, 2, 126301, 0, "ゆき");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 126401, 3, "2024/06/30 12:00:00", 1, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 126401, 450, 0, 1, "2024/07/03 18:59:59", 2.09, 126401, 373, 0, 0, "クローチェ", 0, 1, 126401, 1, "くろーちぇ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 126501, 3, "2024/06/30 12:00:00", 7, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 126501, 450, 0, 0, "2024/07/03 18:59:59", 1.965, 126501, 740, 0, 0, "ライラエル", 0, 2, 126501, 1, "らいらえる");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 126601, 3, "2024/07/11 12:00:00", 7, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 126601, 450, 0, 7, "2024/07/15 14:59:59", 2.04, 126601, 650, 0, 0, "ネネカ（サマー）", 0, 2, 126601, 1, "ねねか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 126701, 1, "2023/06/30 12:00:00", 5, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 126701, 450, 0, 5, "2030/12/31 15:00:00", 1.965, 126701, 224, 0, 0, "アキノ（サマー）", 0, 1, 126701, 1, "あきの");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 126801, 3, "2023/07/15 15:00:00", 5, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 126801, 450, 0, 5, "2030/12/31 15:00:00", 1.97, 126801, 159, 0, 0, "ユカリ（サマー）", 0, 1, 126801, 0, "ゆかり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 126901, 3, "2024/08/09 12:00:00", 7, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 126901, 450, 0, 21, "2024/08/12 11:59:59", 1.965, 126901, 682, 0, 0, "ランファ（サマー）", 0, 2, 126901, 1, "らんふぁ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 127001, 1, "2023/07/31 12:00:00", 2, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 127001, 450, 0, 52, "2023/08/14 20:59:59", 1.97, 127001, 133, 0, 0, "クウカ（サマー）", 0, 1, 127001, 1, "くうか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 127101, 3, "2024/08/09 12:00:00", 5, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 127101, 450, 0, 46, "2024/08/12 11:59:59", 2.09, 127101, 255, 0, 0, "シノブ（サマー）", 0, 1, 127101, 1, "しのぶ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 127201, 3, "2024/03/28 12:00:00", 7, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 127201, 450, 0, 7, "2024/03/31 11:59:59", 2.09, 127201, 804, 0, 0, "キャル（編入生）", 0, 2, 127201, 1, "きゃる");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 127301, 3, "2023/09/15 15:00:00", 8, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 127301, 450, 0, 8, "2030/12/31 15:00:00", 2.09, 127301, 750, 0, 0, "スズナ（編入生）", 0, 1, 127301, 0, "すずな");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 0, 3, "2015/04/01 15:00:00", 1, "", 0, 0, 0, 1, "2030/12/31 15:00:00", 0.0, 127401, 0, 0, 0, "ビカラ（コラボ）", 0, 0, 127401, 1, "びから");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 127501, 3, "2024/04/26 12:00:00", 4, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 127501, 450, 0, 4, "2024/04/30 11:59:59", 2.09, 127501, 304, 0, 0, "サレン（サラサリア）", 0, 1, 127501, 1, "されん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 127601, 3, "2023/10/15 15:00:00", 4, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 127601, 450, 0, 4, "2030/12/31 15:00:00", 1.965, 127601, 157, 0, 0, "ルカ（サラサリア）", 0, 1, 127601, 0, "るか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 127901, 3, "2024/05/27 12:00:00", 5, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 127901, 450, 0, 5, "2024/05/31 11:59:59", 1.965, 127901, 372, 0, 0, "ペコリーヌ（クリスマス）", 0, 2, 127901, 1, "ぺこりーぬ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 128001, 3, "2023/12/15 15:00:00", 35, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", 128001, 450, 0, 35, "2030/12/31 15:00:00", 2.09, 128001, 723, 0, 0, "クレジッタ（クリスマス）", 0, 1, 128001, 0, "くれじった");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 0, 3, "2015/04/01 15:00:00", 0, "", 0, 0, 0, 0, "2030/12/31 15:00:00", 0.0, 128101, 580, 0, 181101, "シズル（シズル&リノ）", 0, 0, 128101, 1, "しずる");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 0, 3, "2015/04/01 15:00:00", 0, "", 0, 0, 0, 0, "2030/12/31 15:00:00", 0.0, 128201, 580, 0, 181101, "リノ（シズル&リノ）", 0, 0, 128201, 1, "りの");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 128301, 1, "2023/12/31 12:00:00", 3, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 128301, 450, 0, 38, "2030/12/31 15:00:00", 2.09, 128301, 191, 0, 0, "イノリ（ニューイヤー）", 0, 1, 128301, 1, "いのり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 128401, 3, "2024/06/26 12:00:00", 7, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 128401, 450, 0, 21, "2024/06/30 11:59:59", 2.09, 128401, 801, 0, 0, "ハツネ（ニューイヤー）", 0, 2, 128401, 1, "はつね");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 128501, 3, "2024/06/26 12:00:00", 7, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 128501, 450, 0, 21, "2024/06/30 11:59:59", 2.09, 128501, 739, 0, 0, "カスミ（ニューイヤー）", 0, 2, 128501, 1, "かすみ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 0, 3, "2015/04/01 15:00:00", 1, "", 0, 0, 0, 1, "2030/12/31 15:00:00", 0.0, 128601, 0, 0, 0, "リリ（フォールン）", 0, 0, 128601, 1, "りり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 128701, 3, "2024/08/12 12:00:00", 1, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 128701, 450, 0, 0, "2024/08/15 14:59:59", 2.09, 128701, 226, 0, 0, "ヒヨリ（アストラル）", 0, 1, 128701, 1, "ひより");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 128801, 1, "2024/01/31 12:00:00", 4, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 128801, 450, 0, 0, "2030/12/31 15:00:00", 1.965, 128801, 194, 0, 0, "レイ（アストラル）", 0, 1, 128801, 1, "れい");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 128901, 3, "2024/08/12 12:00:00", 7, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 128901, 450, 0, 0, "2024/08/15 14:59:59", 2.09, 128901, 772, 0, 0, "ユイ（アストラル）", 0, 2, 128901, 1, "ゆい");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 129001, 3, "2024/06/30 12:00:00", 7, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 129001, 450, 0, 0, "2024/07/03 18:59:59", 2.09, 129001, 800, 0, 0, "エリス", 0, 2, 129001, 1, "えりす");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 129301, 3, "2024/03/03 19:00:00", 7, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 129301, 450, 0, 7, "2024/03/11 11:59:59", 2.09, 129301, 708, 0, 0, "ユニ（ウィンター）", 0, 1, 129301, 1, "ゆに");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 129401, 3, "2024/03/18 12:00:00", 2, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 129401, 450, 0, 2, "2030/12/31 15:00:00", 2.09, 129401, 188, 0, 0, "クロエ（ウィンター）", 0, 1, 129401, 0, "くろえ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 129601, 3, "2024/06/30 12:00:00", 0, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 129601, 450, 0, 0, "2024/07/03 18:59:59", 2.09, 129601, 550, 0, 0, "アネモネ", 0, 1, 129601, 1, "あねもね");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 129701, 3, "2024/06/30 12:00:00", 0, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 129701, 450, 0, 0, "2024/07/03 18:59:59", 2.09, 129701, 540, 0, 0, "ネフィ＝ネラ", 0, 1, 129701, 1, "ねふぃーねら");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 129801, 3, "2024/03/31 12:00:00", 5, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 129801, 450, 0, 5, "2024/04/12 11:59:59", 2.09, 129801, 269, 0, 0, "マコト（コマンダー）", 0, 1, 129801, 1, "まこと");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 129901, 3, "2024/04/15 15:00:00", 6, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 129901, 450, 0, 48, "2030/12/31 15:00:00", 1.84, 129901, 294, 0, 0, "エリコ（コマンダー）", 0, 1, 129901, 0, "えりこ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 0, 3, "2015/04/01 15:00:00", 4, "", 0, 0, 0, 1, "2030/12/31 15:00:00", 0.0, 130601, 0, 0, 0, "レイ（アストラル）", 0, 0, 130601, 1, "れい");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 130701, 3, "2024/05/03 19:00:00", 7, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 130701, 450, 0, 7, "2024/05/15 14:59:59", 1.92, 130701, 563, 0, 0, "キョウカ（スプリング）", 0, 2, 130701, 1, "きょうか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 130801, 3, "2024/05/15 15:00:00", 7, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 130801, 450, 0, 7, "2030/12/31 15:00:00", 1.84, 130801, 558, 0, 0, "スズメ（スプリング）", 0, 2, 130801, 0, "すずめ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 130901, 3, "2024/06/15 15:00:00", 7, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 130901, 450, 0, 7, "2030/12/31 15:00:00", 2.09, 130901, 440, 0, 0, "クルル", 0, 2, 130901, 0, "くるる");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 131001, 3, "2024/05/31 12:00:00", 7, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 131001, 450, 0, 7, "2024/06/10 11:59:59", 1.84, 131001, 702, 0, 0, "マホ（ドリームパーク）", 0, 2, 131001, 1, "まほ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 131101, 3, "2024/06/30 12:00:00", 2, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 131101, 450, 0, 52, "2030/12/31 15:00:00", 2.09, 131101, 165, 0, 0, "ネア（サマー）", 0, 1, 131101, 0, "ねあ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 131201, 3, "2024/07/03 19:00:00", 35, "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", 131201, 450, 0, 35, "2024/07/15 15:00:00", 2.09, 131201, 753, 0, 0, "ミソラ（サマー）", 0, 2, 131201, 1, "みそら");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 0, 3, "2015/04/01 15:00:00", 1, "", 0, 0, 0, 1, "2030/12/31 15:00:00", 0.0, 131301, 0, 0, 0, "リリ", 0, 0, 131301, 1, "りり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 0, 3, "2015/04/01 15:00:00", 1, "", 0, 0, 0, 1, "2030/12/31 15:00:00", 0.0, 131401, 0, 0, 0, "クリア", 0, 0, 131401, 1, "くりあ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 1, 0, 3, "2015/04/01 15:00:00", 1, "", 0, 0, 0, 1, "2030/12/31 15:00:00", 0.0, 131501, 0, 0, 0, "プレシア", 0, 0, 131501, 1, "ぷれしあ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 131601, 3, "2024/07/15 15:00:00", 4, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 131601, 450, 0, 4, "2024/07/26 11:59:59", 1.92, 131601, 399, 0, 0, "リリ（サマー）", 0, 1, 131601, 1, "りり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 131701, 3, "2024/07/31 12:00:00", 44, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", 131701, 450, 0, 53, "2024/08/12 11:59:59", 1.92, 131701, 743, 0, 0, "アメス（サマー）", 0, 2, 131701, 1, "あめす");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 131801, 3, "2024/08/15 15:00:00", 7, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 131801, 450, 0, 21, "2030/12/31 15:00:00", 2.09, 131801, 709, 0, 0, "ホマレ（サマー）", 0, 2, 131801, 0, "ほまれ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 105701, 3, "2015/04/01 15:00:00", 34, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", 170101, 450, 0, 34, "2030/12/31 15:00:00", 1.965, 170101, 245, 4, 0, "ジータ", 0, 1, 170101, 0, "じーた");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 180101, 3, "2024/06/30 12:00:00", 0, "【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。", 180101, 450, 0, 0, "2024/07/03 18:59:59", 1.62, 180101, 199, 7, 0, "ヒヨリ（プリンセス）", 0, 1, 180101, 1, "ひより");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 180201, 3, "2024/06/30 12:00:00", 0, "【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。", 180201, 450, 0, 0, "2024/07/03 18:59:59", 1.92, 180201, 767, 1, 0, "ユイ（プリンセス）", 0, 2, 180201, 1, "ゆい");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 180301, 3, "2024/06/30 12:00:00", 0, "【物理】中衛で風刃を従え激戦を流麗に征く嵐翼の剣士。\n敵が多い程に効果が高まる自己強化スキルで、自身を奮い\n立たせ、強力な範囲攻撃スキルで一切の敵を鏖滅する。", 180301, 450, 0, 0, "2024/07/03 18:59:59", 1.965, 180301, 377, 7, 0, "レイ（プリンセス）", 0, 1, 180301, 1, "れい");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 180401, 3, "2024/06/30 12:00:00", 0, "【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。", 180401, 450, 0, 0, "2024/07/03 18:59:59", 1.965, 180401, 155, 1, 0, "ペコリーヌ（プリンセス）", 0, 1, 180401, 1, "ぺこりーぬ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 180501, 3, "2024/06/30 12:00:00", 0, "【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。", 180501, 450, 0, 0, "2024/07/03 18:59:59", 2.14, 180501, 555, 1, 0, "コッコロ（プリンセス）", 0, 1, 180501, 1, "こっころ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 180601, 3, "2024/06/30 12:00:00", 0, "【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。", 180601, 450, 0, 0, "2024/07/03 18:59:59", 1.92, 180601, 747, 1, 0, "キャル（プリンセス）", 0, 2, 180601, 1, "きゃる");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 180701, 3, "2024/06/30 12:00:00", 0, "【物理】後衛から、真の絆の力を発揮する仲良し姉妹。\n敵の数が増えるほど威力が高まる攻撃スキルと、周りの\n味方を強化するスキルを操り、立ち塞がる敵を一掃する。", 180701, 450, 0, 0, "2024/07/03 18:59:59", 1.75, 180701, 732, 1, 0, "ハツネ＆シオリ", 0, 1, 180701, 1, "はつねしおり");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 180801, 3, "2024/06/30 12:00:00", 0, "【物理】中衛で敵単体に必殺の一撃を放つ仲良しトリオ。\n３人の力を合わせて放つ攻撃は、相手の弱点に合わせて\n物理から魔法攻撃に変化し、どんな強い敵も退治する！", 180801, 450, 0, 0, "2024/07/03 18:59:59", 1.5, 180801, 465, 1, 0, "ミソギ＆ミミ＆キョウカ", 0, 1, 180801, 1, "みそぎみみきょうか");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 180901, 3, "2024/06/30 12:00:00", 0, "【物理】中衛で背を預けあう最高の好敵手で親友の二人。\n味方の物理攻撃をサポートしつつＨＰとＴＰを継続回復し\nＨＰが多いほど威力が増すＵＢで、共に勝利の道を征く。", 180901, 450, 0, 0, "2024/07/03 18:59:59", 2.09, 180901, 421, 1, 0, "アキノ＆サレン", 0, 1, 180901, 1, "あきのされん");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 181001, 3, "2024/06/30 12:00:00", 0, "【魔法】中衛で、魔力共鳴し連撃を放つマナリアの双姫。\nステータスアップ効果を受けると増加する【友情の魔印】\nがスキルを強化し、波長を合わせた炎の魔槍で敵を討つ。", 181001, 450, 0, 0, "2024/07/03 18:59:59", 2.09, 181001, 577, 1, 0, "アン＆グレア", 0, 2, 181001, 1, "あんぐれあ");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 0, 0, 181101, 3, "2024/06/30 12:00:00", 0, "【物理】中衛でお揃い衣装の、真偽を超えた仲良し姉妹。\n攻守共に味方を支えるシズルと、クリティカル時に強力な\nダメージを与えるリノ、姉妹の絆で困難を跳ね除ける！", 181101, 450, 0, 0, "2024/07/03 18:59:59", 1.92, 181101, 551, 1, 0, "シズル＆リノ", 0, 1, 181101, 1, "しずるりの");
